(110, 436, 'financial review of potential market ', 'Assignment Criteria\r\n1.\r\nBuilding on your previous assignment 1, prepare a brief analysis of your target country on the basis of economic, financial and political considerations.\r\n2. Graphs and tables are great ways to present quantitative data. Look at current situation, trends and forecasts that are available on the internet. Government sites, NGO\'s and other international publications are available for free.\r\n\r\nItâ€™s the continuation of meat assignment. \r\nTotal word count -1000 , 1.5 word spacing and cite references also. ', 2, 'International Business', '[\"Other\"]', 'Diploma', '[\"International-Trade-Finance\"]', '2022-03-12', '20:39', '25/02/2022 01:02:42', '1200', 'D05429FB-F1C0-423D-98DA-8BC7D0383361.jpeg_$_', '7', '98', 1, 1, 1, 1, 1, 0, 0),
(111, 436, 'Assignment ', 'Assgnmnt topic- \r\nYou have just joined Watt industries ( a manufacturer of cold drinks ) in Canada as VP, Product Development. Your boss, the CEO Charlie Watt is looking to develop many new products so he can take on Coke an pepsi in various INTERNATIONAL MARKETS and wants you to write a report to coach him on what you think he should do ( and why) to prepare for and execute his new product development initiatives.\r\n\r\nfont size-12 , double spaced and cite all the references. ', 2, 'International business', '[\"Report Writing\"]', 'Diploma', '[\"Development-of-product-and-services-for-an-international-market\"]', '2022-02-27', '09:00', '25/02/2022 23:02:37', '1100', '_$_', '7', '91', 1, 1, 1, 1, 1, 0, 0),
(112, 524, 'Simulation of vehicle path  for autonomous vehicles for different scenarios. ', '\r\nScenarios to be simulated - \r\n1. Longitudinal and lateral control of the vehicle along with acceleration and braking. \r\n2. Highway conditions like lane changing and maintaining speed. \r\n3. Analysing and reaction to the situation of a traffic signal or sudden stop. \r\n4. Condition when it comes in contact or when it\'s about to come in contact with a pedestrian. \r\n\r\nSoftware: \r\nCARLA - Open source Simulation software. \r\n\r\nMain outcomes  \r\n1. Create a map (environment for the vehicle to operate) of a known location in Road Runner software by vector zero \r\n2. Gathering sensor data from the various sensors in the above mentioned scenarios. \r\n3. Sensors used should include camera, lidar \r\n4). The sensors should be able to be manipulated as per user needs', 0, 'B.Tech in Automobile Engineering ', '[\"Blackbook\",\"Research Paper\"]', 'Bachelors', '[\"Simulation and Modeling,Sensors and Actuators,Machine Learning,Machine Learning\"]', '2022-03-12', '11:00', '25/02/2022 23:02:12', '10,000', 'guidelines for report MU.pdf_$_BE PROJECT (2).pptx_$_', NULL, NULL, -1, -1, -1, -1, -1, -1, 1),
