(135, 560, 'To plan and design a psychological test', 'You can choose any PSYCHOLOGICAL variable/ domain of your choice. \r\nFirst, make a plan- what is the need? how you will design a test? will there be any sub-variable or not, how many items? etc think and write the details with an explanation. Use steps in test construction.\r\nCome up with an initial pool and finalize the test of a minimum of 15 to 20 items.\r\nWrite about the scoring procedure of your test.\r\nMention about which reliability and validity method/s you will use and why.\r\nMention how you will finalize the normative representative sample/ How you will form norms.\r\nWrite about the probable implications and uses of our test.\r\nWrite about the probable limitations of your tool.\r\n', 3, 'Psychology', '[\"Other\"]', 'Bachelors', '[\"Psychological Testing\"]', '2022-03-10', '21:00', '03/03/2022 06:03:32', '1000', '_$_', '7', '70', 1, 1, 1, 1, 1, 0, 0),
