(138, 569, 'To conduct a numerical study on flow behaviour around Airfoil with Riblet', 'I need to simulate flow over naca 0012 airfoil with triangular and trapezium riblet in turbulent regime. This has to be at velocity of 7 and 14 m/s. With validation, grid independence and pressure coefficient graph and pressure contour. The grid will consist of 500000 cells and time taken for simulations will be 5 hours. I am facing problem in meshing and validation.', 0, 'Mechanical ', '[\"Research Paper\"]', 'Bachelors', '[\"Fluid Mechanics\"]', '2022-04-30', '13:44', '05/03/2022 01:03:53', '5000', '_$_', NULL, NULL, -1, -1, -1, -1, -1, -1, 1),
