(145, 577, 'How emotions like envy contribute to economic inefficiencies', 'Essay Type â€“ Argumentative Essay (sample give for format, please follow) \r\n\r\nPlease write a 2,500-word literature review that provides a critical synthesis of a minimum of 20\r\nacademic sources (i.e., academic journal articles, preferably, with DOl numbers; chapters in edited books; or\r\nmonographs) on a topic of your choice (preferably your dissertation topic).\r\nThe literature review needs to accomplish the following:\r\ncritically synthesise the theoretical research and empirical studies that have already been conducted by other\r\nresearchers on the topic(s) relevant to your research question, as well as any cross-sections of these;\r\nâ€¢ identify a research gap (through counter-claiming, identifying a niche, question-raising, or continuing a\r\ntradition):\r\nâ€¢ establish a narrow, grounded, and argumentative research question; a hypothesis; and a set of research\r\nobjectives for the research gap identified.\r\n\r\nPapers shorter than 2,250 and longer than 2,750 words lose 10 points. Papers shorter than 2,000 words fail\r\nautomatically. Papers where there are three or more discrepancies between the references used in and after\r\ntext will be awarded 0% in Language and Mechanics and Source Use. Papers that do not contain a minimum of\r\ntwenty (20) academic sources fail automatically. Academic sources are academic journal articles, preferably, with\r\nDOI numbers; chapters in edited books; and monographs. Poor academic practice (e.g., quoting directly from\r\nsources that exceeds 10% of the paper) will result in automatic fail.', 2, 'International Strategic Management', '[\"Literature Review\"]', 'Bachelors', '[\"Behavioral Economics\"]', '2022-03-20', '12:00', '07/03/2022 02:03:05', '2500', '_$_', '7', '79', 1, 1, 1, 1, 1, 0, 0),
