(316, 485, 'Reflections on Readings', 'Students will write their reflections on the assigned readings. The reading list will be updated as we go ahead in the course. \r\n\r\nWord limit per reading : Maximum 500 words. \r\n\r\nReading 1 : https://objectivejournalism.org/2020/07/a-more-specific-letter-on-justice-and-open-debate/\r\n\r\nReading 2 : Caste and Castelessness: Towards a Biography of the \'General Category\' - Deshpande (2013) \r\n\r\nReading 3 : Caste and Organization Studies : Chrispal, Bapuji & Zietsma (2021)\r\n\r\nReading 4 : A Brief History of Consumer Culture  - https://thereader.mitpress.mit.edu/a-brief-history-of-consumer-culture/\r\n\r\nReading 5 : Opinion Piece on Climate Crisis by George Monboit - https://www.theguardian.com/commentisfree/2022/jan/04/dont-look-up-life-of-campaigning', 2, 'Culture and Communication ', '[\"Other\"]', 'Bachelors', '[\"Culture and heritage,Communication,Caste system in India,consumerculture,Journalism and Mass communication\"]', '2022-04-20', '22:00', '18/04/2022 00:04:17', 'Rupees 1500 negotiable', '_$_', '9', '62', 1, 1, 1, 1, 1, 1, 0),
