(320, 749, 'What are Indian parents\\\' perceptions of their adolescent athletes\\\' career trajectory into elite sports? ', 'I need an introduction and literature review to be written by EOD. Max words- 1000. If 1000 words aren\'t enough to include everything mentioned below, then you can go +500, but not more than that. PLEASE WRITE ONLY SUBSTANTIVE STUFF IN THE MOST PROFESSIONAL MANNER.\r\nThis assignment is part of my dissertation so I\'d request your best writer to indulge in it.\r\n\r\nBroad topic: Parents\' involvement in their children\'s sports participation.\r\nResearch question: What are Indian parents\' perceptions of their adolescent athletes\' career trajectory in elite sports? \r\nBasically, what my dissertation will focus on: the psychosocial influences that operate within parents which ultimately contribute to their child\'s career outcome in sports.\r\n\r\nResearch has suggested that parents, rather than teachers/coaches/instructors, are the most influential social factors in childrensâ€™ sports involvement.  \r\nResearch over the years has proved that Sports have much more to offer than what we are currently utilizing. Sports help in building the character and personality of a person, besides being an excellent medium for instilling values like discipline, respect, team spirit, decision making, and keeping depression at bay among many others.\r\nThough it has been established that sport has so many benefits, very few Indian parents involve their kids in sports participation.\r\nAmongst the lot that does as well, there are very few parents who encourage their children to take up a sport as a career (after high school- transitional into college).\r\nWE WANT TO UNDERSTAND WHAT MAKES THE PARENTS TAKE THIS DECISION APART FROM THE SOCIAL FACTORS (eg. finances, a sport not being considered a career, low govt funding, sport politics, caste etc)\r\nWE WANT TO UNDERSTAND HOW THE INDIAN SUBCULTURE AFFECTS PARENTS DECISION MAKING ON HOW THEY SUPPORT THEIR CHILDREN OR NOT SUPPORT (the psychosocial reasons)\r\nWe will understand this via a theoretical model of parental involvement in sport- Teques & Serpa\'s model which was based on Hoover- Dempsey and Sandler\'s model. You will need to link the theory and parental influences- MOST IMP. \r\nI am attaching four papers that I have read. I will request that you use more papers that are mentioned in their references. Papers by Chris Hardwood are a huge plus point if used.\r\n\r\nOverall, India has a good amount of talented kids playing sports at the sub-elite level. Having said that, this does not show up in high-level tournaments like the Olympics. India has the worst per head medal tally at the Olympics. We want to see how parents play a role in this as they are the most influential models in children\'s sports involvement. Through the lit review, and eventually the paper, I want to try and figure out the parental side of things and how they support their child from moving into elite level sport, that is, choosing a career in sport. And how my study can help understand parents cope with stress and how we can minimize the dropout rates of potentially the next generation of sports athletes and eventually better the medal tally at big tournaments like the Olympics.\r\n', 2, 'Sport psychology', '[\"Literature Review\"]', 'Masters', '[\"Sports, exercise and health science\"]', '2022-04-19', '22:00', '18/04/2022 11:04:49', '1500-2000', 'Parents About Parenting Dual Career Athletes- A Systematic Literature Review.pdf_$_Parental involvement in sport- Psychometric development and empirical test of a theoretical model.pdf_$_Indian sport- Problems and prospects.pdf_$_Elite & Sub-Elite Youth Athletes.pdf_$_', '4', '62', 1, 1, 1, 1, 1, 0, 0),
(321, 752, '1. Sports Law- with respect to cristiano ronaldo removing the coca cola bottles,discuss contractual obliagtions towards tournament sponsors.  2. Sports analytics- Using analytics,prove whether the tokyo 2020 olympics was profitable or not. 3. Product and brand management- discuss how instagram is used as a brand management tool for players. 4. Strategic manangement - conduct SWOT analysis on premier volleyball league and hockey india league. 5. Sports marketing- using 4 examples,discuss how the marketing mix was successfully used in sport. 6. Sports Sponsorship- you manage gurpreet singh sandhu. Who would you approach to sponsor him and why. 7. International business- identify 5 international markets where pantanjali can expand their operations to. 8. Sports financial management- conduct ratio analysis on 2 sports companies of your choice.', '4-6 page report with images made on Microsoft word. It is okay to refer to Google and make the project. ', 2, 'Masters in sports management ', '[\"Report Writing\",\"Research Paper\",\"Case Studies\",\"Other\"]', 'Masters', '[\"Sports Management\"]', '2022-04-22', '06:00', '19/04/2022 03:04:12', '3000 total', 'Screenshot_20220419-133929_Drive.jpg_$_', '9', '56', 1, 1, 1, 1, 1, 1, 0),
