(335, 763, 'Multinational and Global Economy Essay', 'Essay Question : 1. Critically evaluate the following claim: Arguments about â€˜who is usâ€™ that dominated thinking at the end of the 20th century are no longer valid ways to conceptualize multinational activity. \r\n\r\n\r\n======================================================\r\n\r\n\r\n\r\nIt\'s a 3000 word essay on how ownership of a multinational firm was not the primary concern , rather it was the human capital according to a reading in the end of 20th century called \"Who is us?\" by Robert B. Reich.  \r\n\r\nAnother counter argument to this claim was \"They Are Not Us: Why American Ownership Still Matters\" by Laura Tyson at the start of 21st Century. Which claims how ownership of a firm is important. \r\n\r\nIn the essay we need to write about how the thinking of ownership of a multinational not being important according to Robert B. Reich at the end of 20th Century is not irrelevant in today\'s time. And how the ownership of a multinational firm is becoming more and more important. \r\n\r\nConcluding with -  in today\'s time , who can we consider \"Us\".\r\n', 2, 'Msc International Business , Module : Global Economy and Multinationals', '[\"Essay Writing\"]', 'Masters', '[\"Economic Growth and Development,Economic Application,Economics Advanced level\"]', '2022-04-21', '18:00', '20/04/2022 09:04:11', '4000', 'HBR-WhoIsUS.pdf_$_BUSM028_outline_2022.pdf_$_TheyArenotus.pdf_$_', '4', '91', 1, 1, 1, 1, 1, 0, 0),
