(362, 774, 'Genocide and Mass violence ', 'Write an essay examining the role and importance of violent narratives in an ongoing instance of mass violence. Your essay might explore formal/ informal historiographical narratives behind current violence against an \"enemy population\"/ \"other-ing\", and/ or focus on the role of the media in producing such narratives.\r\n\r\nThe essay must include:\r\n\r\n1) a title- 1 mark\r\n\r\n2) an introduction: 4 marks\r\n\r\n3) a background: 5 marks\r\n\r\n4) the main analysis (could include additional sub-sections): 15 marks\r\n\r\n5) concluding remarks - 3 marks\r\n\r\n6) a reference list- 2 marks\r\n\r\nStyle: APA, 6th Edition\r\n\r\nWord Limit: 3500 words\r\n\r\n', 2, 'Genocide and Mass Violence ', '[\"Research Paper\"]', 'Masters', '[\"International relations\"]', '2022-05-03', '00:00', '26/04/2022 01:04:00', '3000', '_$_', '4', NULL, 1, 1, 1, 1, 1, 0, 0),
(363, 775, 'Behavioural Economics ', 'Choose any ONE chapter from the book (between 4 and 11, both inclusive).\r\nThere are two components of this evaluation:\r\nThe research idea elevator pitch (~1 min MP4 video of your idea) [10 marks]\r\nThe final paper (<=2500 words in WORD document submission) [25 marks]\r\nRead your chosen chapter well and make notes on the authorsâ€™ arguments.\r\nThink of a research question that can be explored/investigated/answered in the thematic area of the chapter through what you learnt from the course.\r\nThink of an experiment [can be designed as a lab, field, or a lab-in-field experiment] that can be used to potentially meet your research objective.\r\nIndicate your choice of chapter and the research question using this form.\r\nReview: Write a brief critique of the chapter in your own words. What are the implications of behavioral insights in the particular area? What are the authorsâ€™ contributions? What are the limitations you observe?\r\nYou are free to refer to other journal articles. Use a proper referencing style and use it consistently [APA, etc.]. Do not refer to more than 10 articles.\r\nResearch Question: State your question/s.\r\nExperiment: Discuss your hypothetical experimental design.\r\n', 3, 'Behavioural Economics ', '[\"Essay Writing\",\"Research Paper\",\"Review Article\"]', 'Bachelors', '[\"Behavioural Economics\"]', '2022-05-05', '21:00', '26/04/2022 03:04:12', '2000', 'Kai Ruggeri_Psychology and BE app.pdf_$_', '9', '54', 1, 1, 1, 1, 1, 0, 0),
