(381, 796, 'Family business ', 'The individual report assesses a student\'s ability to:\r\nsubstantially explain subject specific theories, frames and\r\nconcepts; demonstrate focused synthesis and analytical skills;\r\nwrite concisely and decisively; and identify situations and\r\nprovide advice-recommendations.\r\nIn the individual written report:\r\nFirst, you are required to choose a particular strategic\r\nmanagement theory in the academic field of family\r\nbusiness [i.e. RBV, SEW, agency, institutions], review\r\nthe academic literature and substantially explain aspects\r\nwith regard to your chosen theory [approx 1200 words]\r\nSecond, select two family businesses [small, medium or\r\nlarge] and compare and contrast their strategy-making\r\nthat is - apply your chosen strategic management theory\r\nto each family business and detail similarities and\r\ndifferences [approx 900 words].\r\nThird, identify and outline future scenarios with regard\r\nto your chosen strategic management theory in each firm\r\nand provide advice-recommendations [approx 900\r\nwords]\r\nIntroduction [approx 250 words] and conclusion\r\n[approx 250 words/\r\nThe individual report must be 3500 words and fully\r\nreferenced with a variety of sources.', 2, 'MSc. Entrepreneurship & Innovation', '[\"Report Writing\"]', 'Masters', '[\"Business administration\"]', '2022-05-09', '12:00', '30/04/2022 11:04:12', 'INR 4500/-', '2CA82C6F-48AC-4060-889F-ABAD61042BFE.jpeg_$_', '9', '120', 1, 1, 1, 1, 1, 0, 0),
