(397, 817, 'Machine Learning neural networks code', 'Guidelines:\r\n\r\n1. Total marks is 40 which is equally distributed between report and presentation.\r\n\r\n2. Report should be precise and to the point.\r\n\r\n3. You must be in a position to explain what you write in the report.\r\n\r\n4.  You have to present your work after you submit your report.\r\n\r\n***\r\n\r\n \r\n\r\nThe poverty data is provided in the file â€œPoverty.xlsxâ€. It contains 9557 rows and 143 columns. Each row represents one individual and each column is a feature, either unique to the individual, or for the household of the individual. The data file contains the target column, which represents the poverty level on a 1-4 scale. A value of 1 is the most extreme poverty.\r\n\r\n \r\n\r\nObjective\r\n\r\na) Predict poverty on a household level using ANN. Explain each steps clearly that you would carry out to develop the model.\r\n\r\nb)  Generate your confusion matrix\r\n\r\nNotes:\r\n\r\nThe given data is on the individual level with each individual having unique features but also information about their household.\r\n\r\nWhile all members of a household should have the same label in the training data, there are errors where individuals in the same household have different labels. In these cases, you have to use the label for the head of each household, which can be identified by the rows where â€œparentesco1 == 1.0.â€\r\n\r\nSome of the individuals belong to a household with no head of household, you need to discard those data for training\r\n\r\nThe Target values represent poverty levels as follows:\r\n\r\n1 = extreme poverty\r\n\r\n2 = moderate poverty\r\n\r\n3 = vulnerable households\r\n\r\n4 = non vulnerable households\r\n\r\n \r\n\r\nThe explanations a few features are as follows:\r\n\r\nâ€¢           Id: a unique identifier for each individual, this should not be a feature that we use!\r\n\r\nâ€¢           idhogar: a unique identifier for each household. This variable is not a feature, but will be used to group individuals by household as all individuals in a household will have the same identifier.\r\n\r\nâ€¢           parentesco1: indicates if this person is the head of the household.\r\n\r\nâ€¢           Target: the label, which should be equal for all members in a household\r\n\r\n \r\n\r\n \r\n\r\nFurther details can be found from the link below.\r\n\r\nSource: https://www.kaggle.com/c/costa-rican-household-poverty-prediction/data', 0, 'Machine Learning', '[\"Programming / Coding Assignment\"]', 'Bachelors', '[\"Python Basics\"]', '2022-05-04', '23:59', '04/05/2022 01:05:56', '1800-2000', 'Poverty.xlsx_$_', NULL, NULL, -1, -1, -1, -1, -1, -1, 1),
