(467, 864, 'political economics', 'Word limit for section A: 1200 words\r\n \r\nQuestion A1. The neoclassical school would recommend laissez-faire capitalism, while Keynesian and Marxian schools envision a crucial role for the State in a capitalist economy. Discuss how the three schools differ in their understanding of the State\'s role in a modern capitalist economy.  (20 marks)\r\n \r\n \r\nQuestion A2. Critically discuss the notion of unemployment in neoclassical, Keynesian and Marxian theory. Describe in detail how the three schools differ in their understanding of the source of unemployment and its remedy. (20 marks)\r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\nSection B (2 X 15 = 30 marks)\r\nAnswer any two questions from section B\r\n \r\nWord limit for section B: 900 words per answer\r\n \r\nQuestion B1. How are wages and profits determined in neoclassical theory vis-Ã -vis Marxist economic theory? Describe and differentiate between the treatment of wages and profits in the two schools of thought. (15 marks)\r\n\r\nQuestion B2. In a recession, \"the government should pay people to dig holes in the ground and then fill them up.\" Explain this statement by Keynes using the contours of fiscal policy. (15 marks)\r\n \r\nQuestion B3. Kalecki argued that a government could ensure full employment even in a capitalist economy. Critically discuss Kaleckiâ€™s explanation for why full employment is not reached or maintained in a capitalist economy. (15 marks)\r\n \r\nQuestion B4. Explain the concept of externality in neo-classical economics. Analyse how you think the environment could be affected by this concept and describe a couple of different solutions to the problem. Finally, how do you presume a Marxist would think about externalities (and market-failure in general) based on your knowledge of the Marxian theoretical tradition? (15 marks)\r\n ', 2, 'Law', '[\"Other\"]', 'Bachelors', '[\"Political Economy\"]', '2022-05-28', '21:00', '27/05/2022 22:05:45', '4500', 'PETQ1_Ishan Anand 1.docx_$_', '4', '54', 1, 1, 1, 1, 1, 1, 0),
