(472, 566, 'English reading development in India ', 'I want to base my assignment on how the English reading is developed in the Indian child. How it is inculcated in an individual. Include the internal and external factors that encourages and imprints the development of the language in the child. External factors being the school, society, the background and environment of the child. School plays a very important part. Include school. How the school teaches the readings and how that effects on the childâ€™s liking, hobby or disliking of the language learning. How the English readings are taught in Indian schools from childhood is very important so please include elaborated content on that. Also include a cultural and family aspect of the Indian household. On how that develops the language and reading of the child. How it encourages or diminished the interest in the child. For example, one of the parents reading the child every night before bed or even if that doesnâ€™t happen or there isnâ€™t a hands on physical encouragement there are still other ways like there is a library or a lot of books in the house. Even if the parents are not Avid readers, then encouraging their kid in some or other form or way. \r\nInternal factor, I guess includes the kids own interest. School, teachers, friends, parents, everyone plays an important role. Basically his English reading is developed in India or Indian kids from childhood to adulthood.', 3, 'MA English Education ', '[\"Essay Writing\"]', 'Masters', '[\"English Reading,School Education\"]', '2022-06-06', '08:00', '30/05/2022 06:05:39', '4500', '_$_', '4', '54', 1, 1, 1, 1, 1, 0, 0),
