(607, 891, 'Simulate a service environment to increase customer satisfaction through enhanced service quality in an establishment with an emphasis on service encounters, and techniques of systematic decision making and problem solving.', 'The assignment needs to use a new business idea and not to copy an existing business idea, it has to be in the hospitality industry and have a USP from other existing businesses. The business needs to have an emphases on a service and not a product. The intro needs to mention the what the business is, the business model, the â€œservice concept and service strategyâ€. Literature review and discussion should focus on three basic concepts of â€œ service encounter, decision making and problem solvingâ€. Overall, there needs to be a focus on customer satisfaction and how the business is planning to achieve this by taking some business decisions. There needs to be support for the point that you are making by underpinning with theory or framework for the decision making processes that your business is doing. You can also use real life example to support argument. in the pdf attached Focus on the highlights section and all of those points under it need to be discussed and covered.', 2, 'Hotel Management', '[\"Report Writing\"]', 'Bachelors', '[\"Services-Management\"]', '2022-07-01', '17:00', '15/06/2022 02:06:50', '6500', 'Assessment 2.pdf_$_', '4', NULL, 1, 1, 1, 1, 1, 0, 0),
