(635, 813, 'Empirical paper read and respond ', 'please write up a one-page paper (double spaced) that includes the following sections. If you go a bit over one page, that is okay. Please show, through your writing, that you read more than just the abstract section of the paper.\r\n\r\nExplain the first 3 hypotheses that the researchers are testing (this will be in the introduction! There are 4 hypotheses, but the 4th one is a little complicated for an intro class.)\r\nDescribe how the researchers tested the hypothesis (This will be in the Method section!)\r\nExplain if the researchers supported the first 3 hypotheses (This will be in the beginning of the discussion section!)\r\nExplain three conclusions the researchers draw from their paper (This will be in the discussion section!)\r\nWrite a few sentences explaining what you liked and did not like about reading an empirical paper.', 2, 'Psychology ', '[\"Research Paper\"]', 'Bachelors', '[\"Psychology (Cambridge)\"]', '2022-06-27', '08:00', '26/06/2022 05:06:44', '750', 'F219EB55-96C1-4812-BF1D-B978C5D4CE96.png_$_520A8123-2BBF-4FFF-A5D9-9C1BD928FA8D.png_$_', '4', NULL, 1, 1, 1, 1, 1, 0, 0),
