(734, 983, 'Sociology Review on the movie Pink', 'a research on the sociological perspective is to be given on the feminism aspects in the movie pink starring tapsee pannu and amitabh bachhan. the objectives to be proven are -\r\n1. Exploring the deep-rooted ideas of the patriarchal society in the mindset of the general people\r\n- To compare the inequality faced amongst genders, especially the females, when it comes to patriarchal power\r\n- To challenge the idea that â€œwomen need menâ€ in a society to win over stronger individuals\r\n\r\nand\r\n\r\n2. Analysing the concept of â€œconsentâ€ through different stages of life - Comparing the idea of â€œconsentâ€ amongst different genders\r\n\r\nand\r\n\r\n3. To study the concept of law and order with regards to females in police forces - Going against the correct party in order to be â€œsafeâ€\r\n\r\nIt is supposed to be a 30-35 paged *typed* assignment and has to be based on sociology concepts given by Kate Millet on radical feminism and other feminism ideas that could be incorporated in this topic\r\n\r\nThe movie is to be used as an example to prove the theories of feminism and patriarchy that are evidently present in the society and especially when it comes to law enforcement \r\n\r\n\r\n', 3, 'sociology, feminism', '[\"Research Paper\"]', 'Bachelors', '[\"Sociology India,Arts and Humanities,Sociological studies\"]', '2022-08-30', '23:45', '19/08/2022 01:08:13', '400 (negotiable)', '3E7D8B5D-0C6A-4B69-AB71-299867B88AA6.jpeg_$_31247C89-144A-4DBC-B767-E8F513246870.jpeg_$_', '4', NULL, -1, -1, -1, -1, -1, -1, 1),
