(870, 1081, 'Hospital management system ', '1. Use my github to commit,need atleast 4 commit \r\n1 use java swing strictly \r\n2. No database use is allowed,  create  arraylist wherever necessary, create login pages for system , Patient, doctor, Community, hospital admin.\r\n3. Create class diagram on lucid \r\n4.NOTES\r\n UI/UX - alignments and panel css (colors)\r\n Data Types - use relevant data types - think of the data attributes for Person, Doctor, House, etc classes -Do not use String for all fields. Use INT, DATE, LONG, Boolean as required. \r\n Validations - as stated - will be tested on NULL and data types ONLY - eg: Age of type INT should not accept String or Null.\r\n Error handling - No errors on your terminal - use try, catch wherever necessary | Forms should not be submitted with Null values.\r\n Demo of the application should be smooth - not stop due to error\r\n All 15 classes need to be implemented - you can extend it if you have to, but do not delete a class\r\n INHERITANCE should be applied on relevant classes\r\n Panels - At least 5 panels required: System Administrator, Doctor, Patient, Community Admin and Hospital Admin \r\n CRUD can be implemented in the same panel - e.g: A Hospital Administrator can perform all CRUD operations on Doctors in the same panel\r\n README file is important \r\n Commit history - more than 5 logical commits are required\r\n UNIQUE ID - for a person, doctor, encounter wherever valid is necessary\r\n NO DATABASE required - USE ARRAYLIST or suitable DATA STRUCTURES for the DIRECTORIES \r\n person class - at least 5 attributes.\r\n For the other classes \r\n(DOCTOR, HOSPITAL, HOUSE, VITAL, ENCOUNTER) you can think of at least 3 primitive attributes apart from the non-primitive attributes that connect the classes.\r\n16. Sequence diagram - 1 Flow from System admin perspective 1 - Doctor flow 1 - patient flow', 0, 'Application development ', '[\"Programming / Coding Assignment\"]', 'Masters', '[\"Application-development\"]', '2022-10-30', '15:00', '28/10/2022 22:10:43', 'U can tell me i can do as much as rs 10000', 'Assignment 2.pdf_$_assignment 2 more details.pdf_$_', '11', NULL, -1, -1, -1, -1, -1, -1, 1),
(872, 1025, 'Own choice write-up', 'Take up a couple of texts (short story, movie, case study, newspaper reports, etc.) and discuss them within the light of one of the concepts/frameworks discussed in the course.\r\n\r\nFrameworks - Gender and development, women and development, women in development\r\n\r\nExample topics - menstruation, discrimination at workplace, child marriage etc.\r\n\r\nWord limit: 1300 - 1500 words\r\nZero plagiarism tolerance. Any such instance will lead to a non-negotiable zero for the complete assignment.\r\n\r\nReadings done in class can be used for motivation (sorted by latest done):\r\n\r\n1) From THE WOMEN, GENDER AND DEVELOPMENT READER edited by Nalini Visvanathan, Lynn Duggan, Nan Wiegersma and Laurie Nisonoff. The book is readily available online.\r\nChapter 9 Gender as a social determinant of health: evidence, policies, and innovations Gita Sen and Piroska Ostlin\r\nChapter 19 Subordination and sexual control: a comparative view of the control of women Gita Sen\r\nChapter 32 Caring for people with HIV: state policies and their dependence on womenâ€™s unpaid work Anesu Makina\r\n\r\n2) \r\nhttps://www.epw.in/node/154695/pdf\r\nhttps://scroll.in/article/921679/this-election-season-indias-policymakers-would-do-well-to-read-premchands-stories-about-farmers\r\nhttps://theprint.in/india/how-caste-marital-rules-house-work-prevent-rural-women-from-eating-nutritious-diet/300683/\r\n\r\nFor the ones interested in intersectionality: \r\nhttps://www.vox.com/the-highlight/2019/5/20/18542843/intersectionality-conservatism-law-race-gender-discrimination\r\n\r\n3) Sarbani Guha Ghosal (2005). Major Trends Of Feminism In India. The Indian Journal of Political Science, 66.4, 793-812. https://www.jstor.org/stable/41856169\r\n\r\n4) Feminisms\r\nhttps://diglib.bis.uni-oldenburg.de/pub/unireden/ur97/kap1.pdf\r\nhttps://muse.jhu.edu/article/28377/pdf\r\n\r\n5) https://www.econstor.eu/bitstream/10419/148819/1/863101828.pdf\r\n\r\n6) old mail (contains repeated) Introduction to Nalini Visvanathan, Lynn Duggan, Nan Wiegersma and Laurie Nisonoff\'s \"The Women, Gender and Development Reader.\" [optional]\r\n\r\nIntroduction to  Janet Henshall Momsen\'s \"Gender and Development.\"\r\n\r\nIntroduction to  Cecile Jackson and Ruth Pearson\'s \"Feminist Visions of Development: Gender, Analysis and Policy.\"\r\n\r\nPrecisely explained: http://people.uncw.edu/ricej/theory/Varieties%20of%20Feminism.htm\r\n\r\nFeminisms: a succinct introduction -\r\nJudith Lorber The Variety of Feminisms and their Contribution to Gender Equality. https://diglib.bis.uni-oldenburg.de/pub/unireden/ur97/kap1.pdf\r\nor [one can read both as well]\r\nNancy Potter (2001) Key Concepts: Feminism, Philosophy, Psychiatry, & Psychology, 8:1, 61-71 (Article) DOI: https://doi.org/10.1353/ppp.2002.0008\r\n\r\nNaila Kabeer (2005) Gender equality and women\'s empowerment: A critical analysis of the third millennium development goal 1, Gender & Development, 13:1, 13-24, DOI: 10.1080/13552070512331332273\r\n\r\nSarbani Guha Ghosal (2005) Major Trends Of Feminism In India, The Indian Journal of Political Science, 66:4, 793-812, : https://www.jstor.org/stable/41856169', 0, 'Gender and Development', '[\"Essay Writing\",\"Review Article\"]', 'Bachelors', '[\"Gender and Sexuality Studies,Gender and Women Studies\"]', '2022-11-07', '12:00', '29/10/2022 02:10:28', '1200', 'gender and development notes.pdf_$_', '13', NULL, 1, 1, 1, 1, 1, 0, 0),
