(890, 1082, 'International risk management (hedging coursework)', 'The assignment is all about risk management. The topics covered are hedging risk and derivatives and market risk ( Interest rate risk and foreign exchange rate risk). Report should contain 2500 words. Basically preparing a report from case study. Also some calculation is to be done( I have the lecture slides which has all the formulas and the methods for calculation). The structure is already mentioned in the assignment.(cover page, executive summary, literature review, main body , conclusion, list of references, bibliography, appendices) Also some articles are mentioned in the question which can be referred for literature review. Also link introduction and recommendations to current market events that may affect the firms questions, such as Brexit, Covid-19, the level of inflation in the uk and Europe etc.', 2, 'Investment and risk finance Mac.', '[\"Report Writing\"]', 'Masters', '[\"Investment analysis and portfolio management,International Risk Analysis\"]', '2022-11-17', '01:00', '04/11/2022 03:11:48', '2000 rs ', 'IRM (7FNCE019W) Hedging Coursework Guidelines (S1, 2022-23)(1) 2.pdf_$_', '13', NULL, 1, 1, 1, 1, 1, 0, 0),
(891, 666, 'Business analytics research paper ', '\r\nRESEARCH GAP:\r\nGrowth of startups after the economic disaster led by covid-19.\r\n\r\nWill tech firms affect the growth of startups.\r\n\r\nRESEARCH OBJECTIVES:\r\nTo find  the impact of governmentâ€™s initiatives in booming the startup culture in India.\r\n\r\nTo find whether the growth rate of startups is the same before and after the pandemic \r\n\r\nTo compare US and Indiaâ€™s policy toward increasing Startup culture in their respective country.\r\n\r\nContribution of startups in boosting Indian economy\r\n\r\nComparative study between US and Indian startup market post pandemic\r\n\r\nRESEARCH HYPOTHESIS:\r\nThe tech firms are now at the stake-holding position of the capitalist restructuring during Covid-19 and post-Covid era\r\n\r\nH0: Growth of Tech firms has larger impact on Venture capital startups\r\n \r\n H1: Growth of Tech firms have less impacts on Venture capital startups', 2, 'Business analytics ', '[\"Research Paper\"]', 'Bachelors', '[\"Analytics and Research\"]', '2022-11-18', '12:00', '04/11/2022 19:11:14', '1500', '_$_', '13', NULL, 1, 1, 1, 1, 1, 0, 0),
