(899, 350, 'A report discussing a critical challenge faced by the Indian Hotel Industry in the current business environment with specific reference to customer satisfaction.', 'Introduction: \r\nWhat is service management? \r\nHow it has evolved over the period of time. \r\nHow it plays an important role in the hospitality industry. And lil how it impacts customer satisfaction. \r\n\r\nLiterature review:\r\n Challenges is service management.\r\n\r\nDiscussion: \r\nYou focus on one of the challenges written in LR which you think is the most important challenge. \r\nLink it with some theory. \r\nAnd take some example of a hotel or hotels to tell how they are overcoming the challenge. \r\n\r\nConclusion', 2, 'Hotel management', '[\"Report Writing\"]', 'Bachelors', '[\"Services-management\"]', '2022-11-10', '10:30', '07/11/2022 23:11:32', '2600', 'Assessment Task 1 - 2022-23 BHI 4048 - Services Management.docx_$_', '4', NULL, -1, -1, -1, -1, -1, -1, 1),
