(916, 196, 'BLOOD CELL COUNT', 'PROJECT OF MRUNAL..\r\nThe aim of this paper is to segment WBCs and RBCs in the peripheral blood cell images into distinguishing images.WBC and RBC segmentation plays a critical role in helping doctors early diagnose some sign of the diseases which affected blood cells.In this paper, U-Net - an innovative CNN architecture - are performed for the identification and segmentation of WBCs and RBCs in images. To solve the challenge, we manually label images to create standard annotation images. From the experiments on two datasets, we conclude that U-Net is highly appropriate for segmenting WBCs and RBCs in blood images.', 0, 'AIML', '[\"Programming / Coding Assignment\"]', 'Bachelors', '[\"AI & ML\"]', '2022-11-19', '11:30', '10/11/2022 22:11:58', 'NA', 'NMIS information system for managers (1).docx_$_', '3', NULL, 1, 1, 1, 1, 1, 0, 0),
(917, 19, 'Strategic Management Essay- User id 428 Harshvardhan', 'Write an essay on any one of the following topics below:\r\nChoose ONE of the following options for your essay:\r\n\r\n(a) To what extent can organisations affect employees\' motivation? Critically discuss this question.\r\n\r\n(b) Should leaders take personality into account when creating teams at work? Critically discuss this question.\r\n\r\n(c) How and why may inequality and discrimination at work affect performance? Critically discuss this question.\r\n\r\n(d) What is a psychological contract and why should managers know about it? Critically discuss this question.\r\n\r\n(e) You may construct your own essay title; however, this will need to be approved by the module convenor by November 4.\r\n\r\nYou are encouraged to combine theory, empirical research as well as practical examples in your\r\n\r\nessays.\r\n\r\nEssay formatting guidelines\r\n\r\nThe essay is to be of length not exceeding 1,700 words, including footnotes, but excluding any contents\' page and appendices/annexes/reference lists. It should be\r\n\r\na) Submitted via Turnitin in A4 format;\r\n\r\nb) Font: Times New Roman, Size 12;\r\n\r\nc) Line spacing: 1.5;\r\n\r\nPlease reference throughout and provide a full reference list at the end according to the Harvard referencing system.', 2, 'MBA', '[\"Essay Writing\"]', 'Masters', '[\"Strategic Business Management\"]', '2022-11-13', '09:00', '11/11/2022 00:11:39', '2600', 'IMG-20221109-WA0001.jpg_$_', '4', NULL, 1, 1, 1, 1, 1, 0, 0),
