(921, 1111, 'Is  hosting a world sport event like Olympics and fifa World Cup beneficial for the nation in the long run ', 'I need a literature review of 20 sources( research papers) minimum on the above topic \r\nStuff like how does hosting a world cup/ olympics has benefited the host and whatâ€™s their status now etc. Taking examples of different fifa world cups etc all this to be done in APA FORMAT ', 2, 'B.Sc. Economics ', '[\"Literature Review\"]', 'Bachelors', '[\"Economic Growth and Development\"]', '2022-11-13', '23:00', '12/11/2022 23:11:11', '1500', '_$_', '13', NULL, -1, -1, -1, -1, -1, -1, 1),
(922, 1113, 'PR Campaign Analysis', 'For this assessment you write a 1000 word analyses, selecting a campaigns and in each case focusing on a PR text as your object of study in each case. The campaign could be for any entity â€“ an individual, group, company, political party, charity/NGO, government, etc. The texts can be a press release, a press conference, a series of media articles that draw heavily on a press release, an event, interview, or even a series of tweets.\r\nUse one or more of the existing critical/theoretical approaches to public relations and apply it/them to your object of study. It is important to provide a critical analysis of your objects of study, rather than simply describe them. You ought to explain how the object of study attempts to persuade or to set the agenda, using the techniques of public relations.\r\n\r\nYou must write your analysis drawing on relevant academic sources to offer depth to your argument.', 3, 'MA Media and PR', '[\"Essay Writing\"]', 'Masters', '[\"Public Relations\"]', '2022-11-16', '22:00', '13/11/2022 09:11:13', 'INR 2000', '_$_', '4', NULL, -1, -1, -1, -1, -1, -1, 1),
(923, 716, 'Strategic management ', 'Streaming Video on Demand (SVoD) is a challenging industry with multiple competitors emerging over the \r\ncourse of the last few years. . You will produce a report for a SVoD company of your choice  (for example, you \r\ncould choose one of the following companies: Netflix, Disney+, Apple TV+, Amazon Prime Video, ...).  \r\nFocus on a particular geographic market (this could be Global, or the UK, US or any other market). \r\nYou are a management consultant for the chosen company. You need to produce an industry analysis report for \r\nthe top managers of the company. \r\nReport needs to answer the following questions: \r\nQ1 â€“ Perform PESTEL analysis of the wider macro environment.  \r\nQ2 â€“ Perform Five forces analysis of the industry. \r\nQ3 â€“ Perform internal analysis of the company. Use VRIO framework to assess its internal capabilities. \r\nQ4 â€“ Summarize main strengths, weaknesses, opportunities and threats your chosen company is facing in a \r\nSWOT matrix. Advise the companyâ€™s leadership what they can do to exploit opportunities and counter threats. In \r\nother words, provide strategic advice for the future. ', 2, 'BBA Honours ', '[\"Essay Writing\"]', 'Bachelors', '[\"Strategic Business Management\"]', '2022-11-23', '00:00', '14/11/2022 05:11:19', '2500', 'BS6201 Strategic management - Industry analysis assignment brief 2022-23.pdf_$_', '13', NULL, 1, 1, 1, 1, 1, 0, 0),
