(925, 918, 'Assignment- Reading Reflection', 'Students will write one reading reflection over the course of the semester (800 words). Each reading reflection should engage critically with the required reading for the selected week; as well as one additional reading from the weekly list. This should not be a summary; students should develop their own argument from the readings that discusses the main arguments of the readings, the points found to be convincing, and those that are unconvincing, with reasons. Additional research is not required, but students should be very careful to stick to the topic and avoid unsubstantiated statements. The reflection will be submitted on Brightspace before the start of class, and presented in small groups each week. The schedule for reading reflections will be arranged in the first class. Official citations, bibliography and page numbers are not required unless you draw on work outside the assigned readings. You may not use extensive quotes in your reflections. You are expected however to acknowledge the author to demonstrate you are engaging with their work (i.e.â€œas Murphy argued, market power...â€). Include 2-4 probing discussion questions to stimulate discussion in class.\r\n\r\nAPA bibliography ', 3, 'Social Science', '[\"Other\"]', 'Bachelors', '[\"Social Science\"]', '2022-11-21', '12:00', '14/11/2022 11:11:33', '2000', '_$_', '13', NULL, 1, 1, 1, 1, 1, 0, 0),
