(942, 1126, 'New enterprise creation', 'Business plan sequence.\r\n\r\nDear students,\r\n\r\nPlease follow the below sequence for the business plan in a single word document\r\n\r\nPart 1.\r\nCover page  with Matriculation no , Student name and Module code and Module Name\r\n\r\nExecutive summary.\r\n\r\nTable of content or Index.\r\n\r\nThen the 12 pages .\r\n\r\nStarting with introduction and end with conclusion.\r\n\r\n1. IntroductionÂ (Basically introduce your business idea with the help of WH questions, and support them either with Vision, Mission, Goals & Objectives or with Aims and Objectives or with other parameters)\r\n\r\n\r\n2. Product Description, Analysis & USPÂ (You can describe your product, How your product is different from competition?, and why people will buy your product? Use your creativity and showcase product differentiation and try to gain competitive edge over competitors)\r\n\r\n\r\n3. Target MarketÂ (Whom you are going to concentrate on, could you give some demographic information about potential clientele with adequate justification)\r\n\r\n\r\n4. LocationÂ (Why you have chosen a particular location, could you justify nearby potential environment, with the help of statistical information? or could we critically review the location with adequate justification)\r\n\r\nÂ \r\n\r\n5. Marketing PlanÂ (What will be your marketing strategy, modes of marketing, how you will motivate and attract customers)\r\n\r\n\r\n6. Personnel managementÂ (What will be your responsibilities for the business, do you need staff, then how many and why, what you will pay them and why, how you will recruit them, what skills or key attributes you require )\r\n\r\n\r\n7.Start-up capitalÂ (Could your list which expenses can occur to start-up business [suggestion look for an on-line format - it will help] and you could also specify what will be your capital investment , operational expenditure and bank loan requirement)\r\n\r\n\r\n9. OverheadsÂ (Could you take major initial overheads and give a justification, on how, you have reached to a particular amount)\r\n\r\n\r\n10. Margin (What is your pricing strategy, are you going to consider food cost / labor cost / overhead costs, if yes then why and how)\r\n\r\n11.Conclusion..\r\n\r\nPart 2\r\n\r\nAnnexure properly arranged. Photos of land, menu and furniture\r\n\r\n\r\nPart 3 \r\n\r\nAccounts and financial detail\r\n\r\nReferences list', 2, 'Bachelors in arts International hospitality and tourism management', '[\"Essay Writing\"]', 'Bachelors', '[\"Hotel Management\"]', '2022-12-10', '09:00', '19/11/2022 05:11:19', '3000', '_$_', '13', NULL, -1, -1, -1, -1, -1, -1, 1),
