(946, 1129, 'HEALTHCARE TRACKER WITH LIVE CHATBOT SYSTEM', 'Today, the application of artificial intelligence (AI) in healthcare is growing. Here, automated chatbot systems powered by AI have the potential to affect people\'s behaviour via promoting education, promoting health, and other functions. To forecast intake, it is necessary to investigate the driving forces behind using health chatbots; nevertheless, very few research have examined their acceptance to date. This study aims to investigate participants\' openness to interact with chatbots for health care powered by AI. India\'s expanding population, rising birth rate, and lowering death rates as a result of medical advancements have led to a decrease in the number of doctors available to serve the country\'s expanding population.\r\n\r\nTo deal with such cases there is a need for a smart chatbot and Intelligent that can give advice to doctors and sometimes even patients about what to do in such situations that ultimately lead to the saving lives of hundreds of people. A situation because sometimes doctors can make a mistake while looking for symptoms but a specially designed machine cannot make such a mistake. This AI-based medical discussion can make a decision based on the patient\'s request. In this case, it uses its own database and in some cases where something is not available in its database at the request of the user, it collects information from a search engine like Google and provides it to the user in Audio format as Google does.\r\n', 0, 'AIML', '[\"Report Writing\",\"Blackbook\"]', 'Bachelors', '[\"AI,AI & ML\"]', '2022-11-20', '22:23', '20/11/2022 09:11:45', 'NA', 'BE REPORT (1) (1).docx_$_HEALTHCARE TRACKER WITH LIVE CHATBOT SYSTEM (2) (2).pptx_$_', '2', NULL, 1, 1, 1, 1, 1, 0, 0),
