(948, 1124, 'Assessment writing', 'You are required to include the word count as an accurate statement of the words used on the NBS Coursework Front Cover for your coursework. If you are found to have exceeded the word count in order to gain an unfair advantage, then your tutor can adjust your grade downwards depending on the amount of additional work submitted.  \r\nâ€¢	If the additional work is up to 500 words, the overall grade for the piece of work will be reduced by 1 grade point (e.g. commendation-MID to commendation - LOW);  \r\nâ€¢	If the additional work exceeds 500 words, the overall grade for the piece of work will be reduced by 3 grade points (e.g. commendation-MID to pass-MID). \r\nâ€¢	These penalties will be applied even if the reduced grade is below a pass grade. \r\nYou are advised to submit work that is as close to the maximum word count as is practical to enable you to demonstrate that you have met all the learning outcomes\r\n  \r\nAlso compare with competitor company', 2, 'Msc Finance and Investment Banking', '[\"Essay Writing\",\"Report Writing\"]', 'Masters', '[\"Financial statement analysis\"]', '2022-11-24', '18:30', '21/11/2022 09:11:29', '6500', 'FSA coursework brief (1).docx_$_Equity Investment - PZ Cusson Plc - Sample 4.docx_$_Equity analysis of Croda Plc - Sample 3.docx_$_Associated British Food Annual report FSA.pdf_$_', '4', NULL, 1, 1, 1, 1, 0, 0, 0),
