(977, 19, 'Statistics and simulation Modelling (RAHMON)', '\r\nQuestion 1\r\nUsing a review of academic literature, explain why manufacturing and service \r\norganisations should consider using simulation modelling in their business \r\noperations. (20 marks)\r\nQuestion 2\r\nUsing Arena, develop a simulation model of a supply chain of your choice. The \r\nstructure of supply chain must incorporate suppliers (minimum 1), manufacturers \r\n(minimum 1), distribution centres (minimum 2), retailers (minimum 2), and one \r\nreturn point on remanufacture should be clearly stated. \r\nDevelop the model further by incorporating three performance measures of your \r\nchoice to the manufacturing plant as well as to the distribution centre site.\r\nDescribe the process used to develop the model and how the performance\r\nmeasures are incorporated. Discuss the results obtained when using multiple \r\nreplications. Submit the simulation model file. (50 marks) \r\nQuestion 3\r\nBased on the results obtained in Question 2, further develop/modify the simulation \r\nmodel to improve the performance. Discuss the approach used to develop this part\r\nand compare the results with that of in Question 2. Provide critical insights on your\r\nmodel developed in Question 3. (30 marks)', 0, 'Masters, Data Analytics ', '[\"Report Writing\"]', 'Masters', '[\"Arena Simulation,Arena Modeling\"]', '2022-12-09', '05:08', '04/12/2022 12:12:38', '9500', '_$_', '13', NULL, 1, 1, 1, 1, 1, 0, 0),
(978, 19, 'Strategic management (Darshil)', ' Streaming Video on Demand (SVoD) is a challenging industry with multiple competitors emerging over the course of the last few years. . You will produce a report for a SVoD company of your choice (for example, you could choose one of the following companies: Netflix, Disney+, Apple TV+, Amazon Prime Video, ...). Focus on a particular geographic market (this could be Global, or the UK, US or any other market). You are a management consultant for the chosen company. You need to produce an industry analysis report for the top managers of the company. Report needs to answer the following questions: Q1 â€“ Perform PESTEL analysis of the wider macro environment. Q2 â€“ Perform Five forces analysis of the industry. Q3 â€“ Perform internal analysis of the company. Use VRIO framework to assess its internal capabilities. Q4 â€“ Summarize main strengths, weaknesses, opportunities and threats your chosen company is facing in a SWOT matrix. Advise the companyâ€™s leadership what they can do to exploit opportunities and counter threats. In other words, provide strategic advice for the future.\r\n\r\nAssignment Stream: Commerce', 2, 'BBA HONS', '[\"Report Writing\"]', 'Bachelors', '[\"Strategic Business Management\"]', '2022-12-09', '06:18', '04/12/2022 12:12:31', '3000', 'BS6201 Strategic management - Industry analysis assignment brief 2022-23.pdf_$_', '13', NULL, 1, 1, 1, 1, 1, 0, 0),
