(1000, 1114, 'Through a case-study format, evaluate ethical, moral, legal or environmental issues with respect to strategic planning outcomes of a real-time hospitality organisation.', 'Review the vision and/or mission statement along with the long-term strategic goals of a hospitality organisation.\r\nDevelop a case example from the practices and the planning process associated with achieving the long-term strategic objective of the hospitality organisation.\r\nUse theories and strategic planning tools to evaluate practices and present future challenges and opportunities in executing the strategic plan for the hospitality organisation.\r\n              ', 2, 'Bba hotel management', '[\"Report Writing\",\"Case Studies\"]', 'Bachelors', '[\"Hotel Management,Strategic Business Management\"]', '2022-12-22', '12:00', '15/12/2022 05:12:07', '3200', 'Strategy mngmt.pdf_$_', '4', NULL, 1, 1, 1, 1, 0, 0, 0),
(1001, 1151, 'Launching New Ventures', 'Individual Report\r\n3, 000 words worth 75% of module mark.\r\n\r\nDeadline: 3pm GMT, January 12th, 2023 online submission via Moodle link\r\n\r\nThere are two parts to the individual report:\r\n\r\nPart 1: Essay (70%) evaluating theoretical frameworks and concepts explaining the process of launching new ventures.  Your report should demonstrate wide reading and comprehension of the theoretical frameworks introduced in the module. You are expected to draw on key concepts and frameworks to analyse the process of launching new ventures. Good reports will draw on theoretical concepts to show understanding of the challenges typically encountered when creating a new venture. This may include frameworks explaining the influence of uncertainty and related knowledge problems on new ventures; strategies for creating new firms, the foundersâ€™ role, and how entrepreneurs can overcome challenges such as resource dependency and liabilities of newness/scale.\r\n\r\nPart 2: A Self-reflection (30%)  Written in the first person (I) this part of the report should demonstrate your personal understanding of the process of creating a new venture. You do not need to draw on theoretical frameworks in Part 2. Instead, you can draw on previous entrepreneurial experiences (e.g., founding your own firm, working for start-ups, entrepreneurial competitions (e.g., Ingenuity) internships, family business etc). It may also be helpful to draw on your experiences during this module. For example, what insights did you gain from designing a Business Model for a new venture? What might you do differently? Finally, you may project into the future to consider how you would approach the process of launching a new venture. Have you gained any insights from this module that you would use in the future if you were creating your own venture or joining a start-up?\r\n\r\nSome key points to consider:\r\n\r\n1)   The individual report requires two parts: Part 1 is a standard academic essay with references, introduction, discussion, and conclusion. Part 2 is a self-reflection written in the first person (I) and based on your personal understanding of the process of launching a new venture.\r\n\r\n2)   A marking rubric for the individual report is provided on Moodle.  Summarising from the rubric, a good report must demonstrate the following:\r\n\r\nUnderstanding of theoretical frameworks introduced during the module to explain the process of launching new ventures;\r\nA clear explanation of what business models are and why they are relevant for launching new ventures;\r\nEvidence of comprehension based on high quality and wide ranging referencing of literature included in the reading list;\r\nSelf-reflection showing personal understanding of the process of launching a new venture.\r\nWell structured, rigorous and logical report.\r\nWord count specified is to be strictly adhered to. A penalty will be applied if this is not adhered to.\r\n\r\nCoursework Submission Requirements:\r\n\r\nThe maximum word count (3, 000) is set by the module convenor and must be adhered to. The penalty for exceeding this limit is a five mark deduction.\r\n\r\nThe actual word count of the assignment must be stated by the student on the first page (cover sheet) of the assignment.\r\nThe overall word count does include citations and quotations.\r\nThe overall word count does not include the references at the end of the report.\r\nThe word count does not include figures and tables.\r\nAppendices may be included and are not included in the word count.\r\nStudents should prepare and submit their coursework assessments in the following format:\r\n\r\nFont:                       Verdana 12 point\r\nSpacing:                 1.5 spaced\r\nMargins:                 Normal (2.5 cm)\r\nReferencing:          Harvard citation style', 2, 'Launching New Ventures - Business ', '[\"Report Writing\"]', 'Masters', '[\"Launching-New-Ventures\"]', '2023-01-02', '09:00', '15/12/2022 06:12:39', '3000-5000', 'Sample report - Launching New Ventures .pdf_$_BUSI4532 Launching New Ventures Individual Report v1.docx_$_', '4', NULL, 1, 1, 1, 1, 0, 0, 0),
