(1022, 1171, 'The Volvo Self-Driving Car Project ', 'Need to complete the assignment as per the attached file.', 0, 'MSc in project Management', '[\"Report Writing\",\"Case Studies\",\"Question and Answer Based\"]', 'Masters', '[\"Organisation-and-systems\"]', '2023-01-05', '23:04', '25/12/2022 16:12:02', '5000', 'ASSIGNMENT Volvo.docx_$_', '4', NULL, 1, 1, 1, 0, 0, 0, 0),
(1023, 1171, 'Leadership and management of project risk', 'Projects present challenges to the Project Manager, not just in their planning and operation, but alsoin terms of effective leadership, management of all interested parties. There are key areas whichneed to be considered when evaluating the success of a project. These can involve variousperspectives depending on experience, knowledge, cultural values, and self-interest. Managing toinitiate a project and maintain progress and required quality to completion can be difficult for theProject Manager.\r\nFor this assessment you are to choose a past project where it is no more than 6 years since projectclosure. You are to write a critical review of the literature in which you should consider thefollowing areas.\r\nKey issues in managing people in projects including leadership and teamwork,and how leadership can be used to improve team performance.\r\nThe factors that can impact on the quality of a project or engineering activity\r\nThe impact of leadership style and team performance on quality issues in your chosen project', 0, 'MSc in project Management', '[\"Essay Writing\",\"Report Writing\",\"PPT Making\",\"Question and Answer Based\"]', 'Masters', '[\"Leadership-and-the-Management-of-Project-Risk,Quality-and-People\"]', '2023-01-05', '23:19', '25/12/2022 16:12:47', '4000', 'ENGM116 Assignment 1-1.pdf_$_', '4', NULL, 1, 1, 1, 0, 0, 0, 0),
(1024, 1171, 'Leadership and management of project risk2 First solar case study', 'Read and analyse the First Solar Case Study (provided) \r\nTask 1: 50% \r\nIdentify three key risks that could impact on quality outcomes. \r\nJustify and support your choice of risks by reference to the literature. For each risk: \r\n1. Build up the relevant risk specifications (see that attached template as a reminder of the field \r\nincluded in this) \r\n2. For each risk \r\na. Justify your choice of impact and probability ratings. \r\nb. Explore the potential mitigation and contingency plans and consider the budgetary \r\nimplications of these plans. \r\nTask 2: 35% \r\nUse two of the techniques covered in the module to explore one or more of these risks in more \r\ndetail. Choose from: Pareto analysis, Riskit Analysis Graph, or the Ishikawa diagram. \r\nJustify your choice of techniques considering their relevance and identifying at which part of the \r\nrisk management lifecycle they are of most value. Support your argument by making reference to \r\nrelevant risk literature. \r\nN.B. for this assignment you must explicitly state and justify any assumptions you have made in \r\naddition to the information provided in the case study. \r\nThe assignment should be submitted in report form with major sections matching the two tasks and \r\nminor sections matching the sub-tasks identified.', 0, 'MSc in project Management', '[\"Essay Writing\",\"Report Writing\",\"PPT Making\"]', 'Masters', '[\"Leadership and Management\"]', '2023-01-05', '23:29', '25/12/2022 16:12:27', '4000', 'ENGM116 Assignment 2-1.pdf_$_', '4', NULL, 1, 1, 1, 1, 0, 0, 0),
(1025, 909, 'Case study analysis of (xyz) company', 'Guidelines for assignment 1:\r\nPick a company \r\n\r\nAnalyse it\'s vision and mission and statement of objectives\r\n\r\nCome up with a central theme of problem for the company\r\n\r\nAnalyse the problem with strategic concepts(use textbook and see what relates to your problem and use it)\r\n\r\nShow Challenges and alternatives for the company \r\n\r\nShow Emle about the solutions\r\n\r\nDo abstract for the same', 2, 'Hotel management', '[\"Case Studies\"]', 'Bachelors', '[\"APA format references\"]', '2022-12-29', '17:00', '26/12/2022 04:12:23', '3000', 'Assignment 1 - FAQ.pdf_$_', '4', NULL, 1, 1, 1, 1, 1, 0, 0),
(1027, 741, 'case study analysis of McDonald\\\'s ', 'Review the vision and/or mission statement along with the long-term strategic goals of a hospitality organisation.\r\nDevelop a case example from the practices and the planning process associated with achieving the long-term strategic objective of the hospitality organisation.\r\nUse theories and strategic planning tools to evaluate practices and present future challenges and opportunities in executing the strategic plan for the hospitality organisation.', 2, 'hotel management ', '[\"Case Studies\"]', 'Bachelors', '[\"Strategic management and simulation\"]', '2022-12-29', '23:00', '29/12/2022 00:12:49', '4,500', 'S5eZuGcNRKbsxAhEk26Q_Idiots Guide to Strategic Management  Assignment 1 (1).pdf_$_', '4', NULL, 1, 1, 1, 1, 1, 0, 0),
(1028, 19, 'CRITICALLY EXAMINE AND DISCUSS THE APPROACHES TO STANDARD SETTING IN ACCOUNTING. ILLUSTRATE THE APPLICATION OF SUCH APPROACHES / YOUR ANALYSIS WITH RELEVANT EXAMPLES - HARSHWARDHAN', 'ASSESSMENT RATIONALE\r\n\r\nThe purpose of the coursework is to enable you to deal systematically and creatively with an important issue in the area of financial accounting policy and practice. The assignment will require a rigorous analysis of the relevant materials, demonstrating a systematic understanding of the issues involved, using appropriate frameworks for analysis, providing appropriate analysis and evaluation, and drawing appropriate conclusions based on logical arguments and supporting evidence. The written piece of work must communicate clearly your analysis, arguments and conclusions.\r\n\r\n\r\nASSESSMENT CRITERIA\r\n\r\nMarks will be awarded according to your ability to deal systematically and creatively with an important issue in the area of financial accounting policy and practice. Your work must show evidence of rigorous analysis of the relevant materials, demonstrate a systematic understanding of the issues involved, use appropriate frameworks for analysis, provide appropriate analysis and evaluation and draw appropriate conclusions based on logical arguments and supporting evidence. The written piece of work must communicate clearly your analysis, arguments and conclusions.\r\n\r\nA good answer will demonstrate the following:\r\n\r\nâ€¢	a rigorous analysis and highly developed comprehension of the coursework topic, showing evidence of a systematic understanding of current debates;\r\nâ€¢	a well-structured critique of ideas / concepts, answering questions such as, â€˜What is said?â€™, â€˜Why it is said?â€™, â€˜Why and how do you react to the points / arguments in the way you do?â€™;\r\nâ€¢	appropriate discussion and evaluation, engaging with financial accounting and reporting policy concepts / ideas as well as real life examples;\r\nâ€¢	logical argument and supporting evidence;\r\nâ€¢	clarity of expression that communicates the points and arguments clearly to the reader.\r\n', 2, 'FINANCIAL ACCOUNTING POLICY AND PRACTICE', '[\"Essay Writing\"]', 'Masters', '[\"Finance-and-Accounting\"]', '2023-01-05', '14:01', '03/01/2023 03:01:56', '1200', '7ACCN022W FAPP COURSEWORK S1 2022 - 2023.doc_$_', '15', NULL, 1, 1, 1, 1, 1, 0, 0),
