(1041, 19, 'ESSAY TITLE This title is chosen . 2. With reference to neuroscientific research, discuss whether inductive and deductive reasoning processes are supported by different brain regions.  This essay title requires searching the literature and identifying brain regions involved in the reasoning processes. These results should then be compared against each other in order to address the essay title. Note that it is key to summarise the evidence properly, which means succinctly explaining the task(s) used and the relevant results obtained -- VAMIKA', 'Your essay should follow these rules:\r\n\r\nÂ·       Examine the essay question.  Make sure you are answering all parts of the question, and not just describing the material presented. For example, for question 3, do not just describe the paradigm, but address empirical evidence. Read some original sources.\r\n\r\nÂ·       Structure â€“ you must structure the material in a way that allows for a logical sequence of ideas. Each paragraph / statement should follow sensibly from its predecessor. The essay should \'flow\'.\r\n\r\nÂ·       Elements: Your essay should have an introduction paragraph, a main body and a conclusion.  These sections should all be linked.\r\n       Each paragraph should comprise a main theme that is illustrated and developed through a number of points (supported by evidence).\r\n\r\nÂ·       Knowledge and Understanding - recognise, recall and show understanding on a range of materials that accurately reflects the main theoretical perspectives. Evidence of wide reading is essential for higher grades.\r\n\r\nÂ·       Critical Evaluation - arguments should be supported by appropriate evidence and/or theory from the literature. All facts MUST be cited.  Evidence of independent thinking, insight and evaluation of the evidence.\r\n\r\nMARKING RUBRIC\r\nDetailed information about the marking rubric used for this first assignment can be seen in this document. We use a categorical marking scheme:\r\n\r\nâ€¢ Distinction â€“ 72, 75, 80, 85, 90, 95\r\nâ€¢ Merit â€“ 62, 65, 68\r\nâ€¢ Pass â€“ 52, 55, 58\r\nâ€¢ Compensated Fail â€“ 40, 45\r\nâ€¢ FailÂ â€“Â 0,Â 15,Â 30\r\n', 3, 'psychology', '[\"Essay Writing\"]', 'Masters', '[\"Neuroscientific-research\"]', '2023-01-09', '13:33', '06/01/2023 02:01:44', '2500', '_$_', '15', NULL, 1, 1, 1, 1, 1, 0, 0),
(1042, 19, 'Organizational behaviour --Harshvardhan', 'Question 1\r\n\r\nTo what extent should managers be responsible for equality and inclusion at work? Critically discuss this question. [50 marks]\r\n\r\nQuestion 2\r\n\r\nTo what extent can leaders improve the effectiveness of their teams? Critically discuss this question.\r\n\r\n[50 marks]\r\n\r\nQuestion 3\r\n\r\nTo what extent can organisations control counterproductive (or \'nasty\') workplace behaviour? Critically discuss this question.\r\n\r\n[50 marks]\r\n\r\nQuestion 4\r\n\r\nDoes performance pay work in all work contexts? Critically discuss this question.\r\n\r\n[50 marks]\r\n\r\nQuestion 5\r\n\r\nWhat is well-being and to what extent are employers responsible for employee well-being? Critically discuss this question. [50 marks]\r\n\r\nQuestion 6\r\n\r\nDoes emotional intelligence matter to modern organisations? Critically discuss this question.\r\n\r\n[50 marks]\r\n\r\nAll questions carry 50 marks.\r\n\r\nThe maximum word limit for each individual question is 1,000 words.\r\n\r\nIf I you are using quotes and information from literature to support your points you must include in-text citations. All quotes must be in quotation marks. All paraphrased points must be in your own words. Citation format: author surname, publication date and page number (if applicable). For example: Acker (2006) argues....You must include a list of references at the end according to Harvard referencing guidelines (the list of references does not count towards your word count).\r\n\r\nIf you answer more questions than specified, only the first answers (up to the specified number)Â willÂ beÂ marked.', 2, 'Financial Accounting Policy and Practice', '[\"Question and Answer Based\"]', 'Masters', '[\"Organizational Behavior\"]', '2023-01-06', '15:19', '06/01/2023 02:01:25', '1200', '_$_', '15', NULL, 1, 1, 1, 1, 1, 0, 0),
