(1068, 1219, 'Leadership and the Management of Project Risk, Quality and People', 'Projects present challenges to the Project Manager, not just in their planning and operation, but also \r\nin terms of effective leadership, management of all interested parties. There are key areas which \r\nneed to be considered when evaluating the success of a project. These can involve various \r\nperspectives depending on experience, knowledge, cultural values, and self-interest. Managing to \r\ninitiate a project and maintain progress and required quality to completion can be difficult for the \r\nProject Manager. \r\n \r\nFor this assessment you are to choose a past project where it is no more than 6 years since project \r\nclosure. You are to write a critical review of the literature in which you should consider the \r\nfollowing areas. \r\n \r\nâ€¢ Key issues in managing people in projects including leadership and teamwork, and how \r\nleadership can be used to improve team performance. \r\n \r\nâ€¢ The factors that can impact on the quality of a project or engineering activity \r\n \r\nâ€¢ The impact of leadership style and team performance on quality issues in your chosen \r\nproject', 0, 'Msc in Project Management', '[\"Report Writing\"]', 'Masters', '[\"Project Management\"]', '2023-01-25', '17:00', '17/01/2023 10:01:05', '5000 ', 'ENGM116 Assignment 1-1.pdf_$_', '15', NULL, 1, 1, 1, 1, 1, 0, 0),
(1069, 19, 'Research Analysis (Autumn Semester). -- VARUN', 'Aim and objectives of your research, which should be clearly stated. Please \r\nnumber the objectives (please see Session 2-Research Motivation).\r\no Explanation of your research topic motivation supported by factual data about the \r\nsignificance of that research (please see Session 2-Research Motivation). Any \r\nfunding opportunity, statistics, roadmaps, governmental report, etc. can be used to \r\nsupport the research significance.\r\no Narrative of the literature review, which should be explained in detail (see Lecture \r\n4-Performing a Comprehensive Literature Review). What would be the steps \r\n(the pathway) that will be later taken to explain the related state-of-the-art to your \r\nown research topic. Note that this section is not a about conducting literature \r\nreview, but to explain that how you will do this later on.\r\no The possible methods (modelling approaches), which should be first identified \r\n(please see Lecture 5-Choosing a Methodology). Then, in respect to your \r\nselected research plan, you should explain how your method is aligned with the \r\nproposed objectives. And, how you would be able to reach to the goal (aim).\r\n', 1, 'Sustainable energy', '[\"Research Paper\"]', 'Masters', '[\"Sustainable-energy\"]', '2023-01-25', '16:25', '19/01/2023 04:01:27', '6000', 'Report Guideline_A_2022.pdf_$_', '15', NULL, 1, 1, 1, 1, 1, 0, 0),
