(1072, 1122, 'TLD - Ethical Poster - HSBC', 'Identify an occasion where an institution has been unethical in the last 5 years.  Using this example as a case study prepare a poster presentation on the following topics:\r\n \r\n1.	Identify and explain the ethical implications that have arisen and how these could be avoided with reference to your choice of ethical codes, i.e safeguards related to codes of conduct in profession.\r\n \r\n2.	Using two or three of the UN Global Goals for Sustainable Development consider how this company could embed these into their best practice.\r\n\r\n', 2, 'MSc Finance and Investment Banking', '[\"Other\"]', 'Masters', '[\"Leadership & Organizational Behavior,Ethics in banking\"]', '2023-01-26', '23:59', '20/01/2023 10:01:56', '5000', 'Proposal for Poster Presentation - HSBC - Anush N1122074.docx_$_Exemplar TLD Poster Handout 1.docx_$_Exemplar References 3.pdf_$_Exemplar References 2.pdf_$_Exemplar Poster Presentation.pdf_$_Exemplar Poster 3.pdf_$_Exemplar Poster 2.pdf_$_Ethical poster Breif.jpeg_$_Designing a Poster Presentation.ppt_$_', '15', NULL, 1, 1, 1, 1, 1, 0, 0),
