(1106, 1137, 'Prosthetic arm using EMG sensor ', 'Build a 3D printed prosthetic arm which can be controlled using an Arduino and EMG sensor.\r\nThe EMG sensor is supposed to be connected to a human arm in parallel and the prosthetic\r\narm is expected to mimic the action of the human arm. The human arm would have EMG\r\nsensors attached to it which streams sensor signals to an Arduino which is processed using a\r\nfirmware written for Arduino. Later Arduino controls the actuation of servo motors that are\r\nattached to prosthetic arm, with this the 3D printed prosthetic arm tries to mimic the motions\r\nof the human arm.', 0, 'Etrx', '[\"IOT/Hardware Projects\"]', 'Bachelors', '[\"IOT\"]', '2023-02-28', '12:58', '07/02/2023 22:02:51', '7000', '_$_', '14', NULL, 1, 1, 1, 0, 0, 0, 0),
(1107, 1259, 'parents behaviour and children self esteem ', 'i m masters student i have to write dissertation on topic parents behaviour and children self esteem . so there is a format in which the dissertation needs to be complete . first i have to submit the proposal and then the whole dissertation. ', 3, 'masters in clinical psychology ', '[\"Dissertation Writing\"]', 'Masters', '[\"psychology\"]', '2023-03-17', '08:00', '07/02/2023 23:02:02', '500', '_$_', '4', NULL, 1, 1, 1, 0, 0, 0, 0),
