(1109, 1255, 'MOTION PREDICTION FOR AUTONOMOUS VEHICLE USING DEEP LEARNING ', 'In short, the project involves two cars with one being autonomous and using a highD dataset and LSTM model to predict its future trajectory and adjust its movement based on the second car (ego vehicle) which can move forward, stop, or turn right or left. The project focuses on motion prediction and is implemented in Python within the Carla simulation environment.', 0, 'B.Tech IT', '[\"Report Writing\",\"Literature Review\",\"Blackbook\",\"Programming / Coding Assignment\",\"PPT Making\",\"Case Studies\"]', 'Bachelors', '[\"motion prediction,simulation,python\"]', '2023-02-28', '09:00', '09/02/2023 07:02:22', '6000-7000', '_$_', '14', NULL, 1, 1, 1, 0, 0, 0, 0),
