(1125, 1267, 'IoT - smart irrigation system', 'Climate-based controllers also referred to as evapotranspiration (ET) controllers use local weather data to adjust irrigation schedules (Figure 1). Evapotranspiration is the combination of evaporation from the soil surface and transpiration by plant materials.  These climate-based controllers gather local weather information and make irrigation run-time adjustments so the landscape only receives the appropriate amount of water.', 0, 'Engineering ( BE project)', '[\"IOT/Hardware Projects\"]', 'Bachelors', '[\"A and AS Computer Science\"]', '2023-03-07', '16:04', '15/02/2023 23:02:37', '10000', 'SMART IRRIGATION SYSTEM PROPOSAL REPORT.docx_$_', '14', NULL, 1, 1, 1, 0, 0, 0, 0),
