(1022, 354, 'TY BLS LLB Assignment 5 subjects.docx_$_', 'Blue', '2022-10-12 13:51:22', '2022-09-22', '', 'Hard Copy', 'Assignment Sheets', 'Habib Educational and Welfare Society\'s\r\nM.S. COLLEGE OF LAW\r\n(Affiliated to University of Mumbai & Recognized by Bar Council of India)\r\nNAAC Accredited\r\nHabib Educational Complex, M.H. Mohani Road, Kausa, Mumbra, Dist. Thane-400 612, Maharashtra\r\n\r\nDate 22nd August 2022\r\n\r\nTY BLS - LLB (SEM-V)\r\nLEGAL LANGUAGE, LEGAL WRITING AND GENERAL ENGLISH\r\nINTERNAL EXAMINATION ASSIGNMENT AND CASE STUDY\r\nA.Y 2022-2023\r\n\r\nPART I â€“ ASSIGNMENT (10 Marks) Attempt all\r\n1.	Damnum Sine Injuria.\r\n2.	Audi alteram partem.\r\n3.	Salus populi est suprema lex.\r\n4.	Caveat emptor.\r\n5.	Actio personalis moritur cum persona.\r\n\r\nNote: \r\nWrite All 5 questions given above on an Assignment paper, one side blank and one side ruled. \r\nWrite full Assignment (Questions and Case law) with a Blue Pen.\r\nEach question should be of Minimum 10 to 12 sides of the page. For 5 questions minimum 50 to 60 sides which actually is  50 to 60 pages since one side is Blank that is without lines.\r\nDraw a half inch margin on right side of the page.\r\nWrite Student Name, Roll no, Class on the top right hand side of the Page.\r\nNumber each page in the centre bottom of the page in Black Pen.\r\nMake Cover page as per photo sent.\r\nMake Index as per the photo sent.\r\nWrite both Case law from the below given.\r\nCase Law should be written in below given manner\r\nFact of the case â€“ minimum 1 side of the page.\r\nIssues: minimum 2 pages.\r\nArguments â€“ 3 pages.\r\nDecision â€“ minimum 1 page.\r\nSubmission date : 20th September 2022.\r\n\r\nPART II.  CASE STUDY (10 marks)\r\n\r\nCase study must include facts, issues, arguments and decision\r\n\r\n1. M.C. Mehta V/s Union of India AIR 1987 SC 965\r\n2. Vishaka & ors V/s State of Rajasthan & ors AIR 1997 SC 3011.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nM. S. COLLEGE OF LAW\r\nAff