(497, 781, 'descripton', ' Subject -Interpretation of statutes  Topic - Juristic writings as external aid of interpretation of statutes. \r\nContent + written in A4 size sheet \r\n\r\nFORMAT FOR THE ASSIGNMENT\r\n1. Cover Page\r\n2. Introduction\r\n3. Objects \r\n4. content-Structured analysis of the topic with statutory provisions and case laws with citations \r\n5. conclusion \r\n6. Bibliography', '2022-09-16 02:39:36'),
