(507, 870, 'descripton', '1 use java swing strictly \r\n2. No database use is allowed,  create  arraylist wherever necessary, create login pages for system , Patient, doctor, Community, hospital admin.\r\n3. Create class diagram on lucid \r\n4.NOTES\r\n UI/UX - alignments and panel css (colors)\r\n Data Types - use relevant data types - think of the data attributes for Person, Doctor, House, etc classes -Do not use String for all fields. Use INT, DATE, LONG, Boolean as required. \r\n Validations - as stated - will be tested on NULL and data types ONLY - eg: Age of type INT should not accept String or Null.\r\n Error handling - No errors on your terminal - use try, catch wherever necessary | Forms should not be submitted with Null values.\r\n Demo of the application should be smooth - not stop due to error\r\n All 15 classes need to be implemented - you can extend it if you have to, but do not delete a class\r\n INHERITANCE should be applied on relevant classes\r\n Panels - At least 5 panels required: System Administrator, Doctor, Patient, Community Admin and Hospital Admin \r\n CRUD can be implemented in the same panel - e.g: A Hospital Administrator can perform all CRUD operations on Doctors in the same panel\r\n README file is important \r\n Commit history - more than 5 logical commits are required\r\n UNIQUE ID - for a person, doctor, encounter wherever valid is necessary\r\n NO DATABASE required - USE ARRAYLIST or suitable DATA STRUCTURES for the DIRECTORIES \r\n person class - at least 5 attributes.\r\n For the other classes \r\n(DOCTOR, HOSPITAL, HOUSE, VITAL, ENCOUNTER) you can think of at least 3 primitive attributes apart from the non-primitive attributes that connect the classes.\r\n16. Sequence diagram - 1 Flow from System admin perspective 1 - Doctor flow 1 - patient flow', '2022-10-28 22:54:48'),
