(526, 1041, 'title', 'ESSAY TITLES Choose ONE of the following questions and write an essay answering it.   1. Critically evaluate whether Levels-of-Processing theory still provides a useful framework for memory research after 50 years.  This essay title requires searching the literature databases and read the various papers by Craik (and others) on LoP. The evaluation part should demonstrate your ability to comment on the literature and construct a convincing argument why you think that LoP is useful (or not) for memory research.  2. With reference to neuroscientific research, discuss whether inductive and deductive reasoning processes are supported by different brain regions.  This essay title requires searching the literature and identifying brain regions involved in the reasoning processes. These results should then be compared against each other in order to address the essay title. Note that it is key to summarise the evidence properly, which means succinctly explaining the task(s) used and the relevant results obtained.  3. Discuss how the remote associates test provides insights into insight problem solving as well as retrieval from semantic memory.  This essay title requires demonstrating your ability to analyse a particular cognitive task. It should show your understanding of what makes a test one that requires problem solving, requires insight, and requires memory retrieval. There is a great opportunity to showcase your theoretical reasoning ability.   4. Evaluate whether the deliberation-without-attention effect is better explained by appealing to memory theory or whether unconscious non-memory processes need to be assumed.  This essay title requires selecting opposing perspectives from the literature and through summarising the evidence, answer the essay title. With this topic, you have complete freedom in selecting the relevant evidence to support your argument. The conclusion you obtain should follow logically from your presentation of the evidence.   Note that for all essay titles, you should first define and describe the concepts and perspectives before continuing with the main part of your essay. ', '2023-01-06 02:05:31'),
(527, 1041, 'title', 'ESSAY TITLES Choose ONE of the following questions and write an essay answering it.   1. Critically evaluate whether Levels-of-Processing theory still provides a useful framework for memory research after 50 years.  This essay title requires searching the literature databases and read the various papers by Craik (and others) on LoP. The evaluation part should demonstrate your ability to comment on the literature and construct a convincing argument why you think that LoP is useful (or not) for memory research.  2. With reference to neuroscientific research, discuss whether inductive and deductive reasoning processes are supported by different brain regions.  This essay title requires searching the literature and identifying brain regions involved in the reasoning processes. These results should then be compared against each other in order to address the essay title. Note that it is key to summarise the evidence properly, which means succinctly explaining the task(s) used and the relevant results obtained.  3. Discuss how the remote associates test provides insights into insight problem solving as well as retrieval from semantic memory.  This essay title requires demonstrating your ability to analyse a particular cognitive task. It should show your understanding of what makes a test one that requires problem solving, requires insight, and requires memory retrieval. There is a great opportunity to showcase your theoretical reasoning ability.   4. Evaluate whether the deliberation-without-attention effect is better explained by appealing to memory theory or whether unconscious non-memory processes need to be assumed.  This essay title requires selecting opposing perspectives from the literature and through summarising the evidence, answer the essay title. With this topic, you have complete freedom in selecting the relevant evidence to support your argument. The conclusion you obtain should follow logically from your presentation of the evidence.   Note that for all essay titles, you should first define and describe the concepts and perspectives before continuing with the main part of your essay. --VAMIKA', '2023-01-06 02:34:28'),
(528, 1041, 'title', 'ESSAY TITLES Choose ONE of the following questions and write an essay answering it. 2. With reference to neuroscientific research, discuss whether inductive and deductive reasoning processes are supported by different brain regions.  This essay title requires searching the literature and identifying brain regions involved in the reasoning processes. These results should then be compared against each other in order to address the essay title. Note that it is key to summarise the evidence properly, which means succinctly explaining the task(s) used and the relevant results obtained -- VAMIKA', '2023-01-06 02:35:22'),
