INSERT INTO `blog` (`id`, `title`, `des1`, `tags`, `main`, `img1`, `img2`, `img3`, `date`, `w_id`, `des2`, `des3`, `des4`, `des5`, `img4`) VALUES
(6, '7 MUST HAVES IN YOUR WARDROBE FOR HER', 'The start of every year brings about a lot of fashion decisions, like â€œWhat should I invest in ?â€, â€œWhat new is trending right now?â€, and â€œIs it worth spending so much on apparel and accessories? â€œ But instead of spending your money on random pieces that probably will end up a fad, what you should consider, is investing in timeless, classic pieces. <br><br> Here are 7 items I think every woman should have in her closet to turn it into a capsule wardrobe! <br><br> <h2> 1. Easygoing denim pants</h2> Denims are timeless. With every new season there comes a new denim trend but denim never goes out of trend. Although slim fit denim is every girlâ€™s favourite but I recommend to have denim pants of all colour and all patterns. Say for example one should have straight fit, flared pants, boyfriend jeans, mom jeans, bell bottoms, etc. A denim for every mood! <br> <br> <h2>2. Little black dress </h2> The iconic LBD. If thereâ€™s one thing Coco Chanel gave us that nobody will ever forget is not the fragrance thatâ€™s so well known but the little black dress. A black dress can be worn at multiple times and it can look different each time. Wear it with sport shoes for a casual look, add a statement belt and black heels for a dressy look and my favourite, add a matching patiala/churidar and contrast dupatta for an Indian look. ', 'Fashion;Style;Her; For Women', 'women-basic-wardrobe-cover.jpg', 'swetapanchamiablog1image1.jpeg', 'swetapanchamiablog1image2.jpeg', 'swetapanchamiablog1image3.jpeg', '2020-06-03', 1, '<br><br><h2>3. Classy power suit</h2>I am so glad that 90s are having a come back but what Iâ€™m even more glad for is the comeback of power suits. No woman has felt more powerful and strong as they have in power suits. Structured clothing can never fit wrong on anybody and power suits are an example of that. Wearing a formal skirt or a formal dress might not be in everyoneâ€™s comfort zone and I feel power suits are an amazing alternative for that. <br><br> <h2>4. White t-shirt</h2>A white t-shirt goes a long way. It goes with literally everything. Get a proper medium size white t-shirt, not too baggy, not too tight. Pair it up with a skirt, pants, shorts, underneath a dungaree etc. and you are good to go. White t-shirt is a staple that every woman should have in their wardrobe as you can never go wrong with it. ', '<h2>5. Silk blouse</h2>Silk might not seem like an affordable option so you could always switch it with satin. But only clothing item that I know that can be worn for formal and informal events is a silk blouse. Pair it up with a pair of trousers for a formal look and tie it like a normal shirt with a flared skirt for a chic look. Dusty rose , powder blue, camel or the evergreen white are my favourite colours for a silk blouse. <br><br> <h2>6. Black strappy heels</h2>Back when the only form of heels was either stilettos or wedges, it was really difficult for me to select. But block heels has been my and I guess every other girlâ€™s saviour ever since they came out. A pair of strappy block heels is something that I donâ€™t think is going out of fashion anytime soon. It came back 2 years ago and is still the most used type of heels till date. It goes with all office, casual and party outfits and every woman must have them in their wardrobe! ', '<h2>7. Statement necklace</h2>Wearing statement earrings can get a little uncomfortable as they are quite huge and our ears end up paining all night. Thatâ€™s why I feel statement necklaces completely changes the game for us women. It can turn a dull outfit into a classy one.Some accentuating chokers can make your collar bones look so good. Colaba in Mumbai is one of my favourite places to find such extraordinary pieces. ', '', 'swetapanchamiablog1image4.jpeg'),
(7, '7 MUST HAVES IN YOUR WARDROBE FOR HIM', 'The start of every year brings about a lot of fashion decisions, like â€œWhat should I invest in ?â€, â€œWhat new is trending right now?â€, and â€œIs it worth spending so much on apparel and accessories? â€œ But instead of spending your money on random pieces that probably will end up a fad, what you should consider, is investing in timeless, classic pieces. <br><br> Here are 7 items I think every man should have in his closet to turn it into a capsule wardrobe! <br><br> <h2>1. Tailored suit</h2>A good fitted tailored suit is something every man should have. Right from work to weddings to a formal date, a classic tailored suit can be worn in a number of ways. In my opinion, a grey or a black suit is more flexible than any other colour as it goes with more colours. You could pair your blazer with denim pants for a more casual look , with linen shorts for a cocktail party look, your pants with a formal shirt etc. the list is endless. A tailored suit might be expensive but it sure is an investment every man should do.\r\n<h2>2. Dark denim pants</h2>As I said, denim is classic and timeless. But a dark pair of denim pants is what suits a man the best. Skinny jeans might be trendy for now but a straight cut dark denim is what will get you through years. Dress it with your sports coat, a polo or your favourite graphic t-shirt, it just wonâ€™t disappoint you. If youâ€™re not so experimental with trying different looks then denim is definitely something you should opt for.', 'Fashion;Style;Him;For Men', 'swetapanchamiablog2image1.jpg', 'swetapanchamiablog2image2.jpeg', 'swetapanchamiablog2image3.jpeg', 'swetapanchamiablog2image4.jpeg', '2020-06-03', 1, '<h2>3. White button down shirt</h2>A good fabric white shirt is every manâ€™s staple. You pair it up with your denim, shorts, trousers, chinos etc. it just goes with everything. A blue toned white shirt is preferred than a yellow toned or else you can end up looking like an eggshell. It holds the power of making a man look extremely professional or casual depending on how you style it and thatâ€™s the beauty of it.\r\n<h2>4. Light coloured chinos</h2>For people who love to experiment with colours and different styles, chinos is something that they definitely should try. Chinos are ideal for more casual affairs but they are changing the game in formal wear too. Offices nowadays are more open to flexible styling and chinos are a game changer for men there. They are so comfortable and yet stylish. Pair it up with a striped t-shirt for a classic look or go old school and throw on a white shirt and youâ€™ll be good to go. All pastel shades are my go to choice for chinos.', '<h2>5. Cashmere sweater</h2>Hereâ€™s a thing about cashmere sweater, not only is it super soft, classic, and warm for the colder months, itâ€™s the ideal piece, whether headed home for the holidays, meeting your girlfriendâ€™s parents for the first time, or even for casual Fridays around the office. Something this versatile definitely deserves a spot in your closet. A solid sweater will last in style more than a checkered or a white one. Go for dark colors like maroon, navy blue, grey, brown etc.\r\n<h2>6. A pair of oxfords</h2>A pair of professional oxfords can never steer you wrong, particularly for formal wear. Choose something in black or brown leather â€“ they can look just as great with suits as they can with khakis and a sport coat. Loafers are definitely a wise addition to your closet, but theyâ€™re also considered less formal than oxfords. If you work in an office with a business professional dress code, itâ€™s best to opt for oxfords. If you have a little more leeway, then polished, neutral loafers are usually fine.', '<h2>7. Good looking watch</h2>Regardless of your job, every man should own at least one grown-up watch: One that has a clean face, leather or metal band, and looks great with more formal clothing. Whether you go for gold, silver, or leather, a well-made watch shows off your personal style, so choose wisely. Of course you can keep your fun plastic watches, but reserve them for casual events and weekends, rather than work. ', '', 'swetapanchamiablog2image5.jpeg'),
(8, 'Top Underrated Shows you might have probably missed out on', 'This Quarantine has left us looking for sources of entertainment at every nook and corner. And obviously, it is going to take some more time before we step out of our houses. That is when these online streaming platforms come into picture. For a country obsessed over motion pictures as the most profound source of media and entertainment, TV Shows and movies seem to be everyones obvious choices for entertainment as well. Netflix & Prime Video havent just become a household name but also one of the common means of a modern day man. \r\n<br>\r\nFollowing is a list of some of the shows, in no particular order which you might have probably missed out on. These are some of the most critically acclaimed shows of our time which went under-shadowed due to some or the other reason. If you are a TV fanatic, trust me, you will be delighted to see the shows enlisted here:\r\n<br>\r\nThe images used below are purely used for visual representation. All rights reserved by their respective owners. Do reach out to us first, in case of any concerns or issues.\r\n<h2>1. Utopia</h2>\r\nThere are shows which make an impact on you in such a way that they leave you sleepless for nights together. Well, Utopia is one such show. A Visual Manuscript for a cult novel goes missing and so two groups of people set out to find it. One of them is a Government Organisation who believes it has a secret which could help save the human race and civilisation on this planet, and the others are a bunch of readers who met online and want it to not go in the wrong hands. How and what happens ahead is beautifully depicted in the most visually enriching experience I have ever had. The show is filled with colourful landscapes and frames, so vivid if seen on a colour palette, that you do feel you are reading a visual novel. The show has two seasons only because it was called off due to it having intense violence and gory scenes that it was broadcasted at 11PM at night in UK, the country of its origin. The show is surprisingly weird and uncomfortable. To get your head around it, maybe try watching its trailer on YouTube ;)', 'TV Series; Web Series; Binge Watch', 'rishabhjainblog1image1.jpeg', 'rishabhjainblog1image2.jpeg', 'rishabhjainblog1image3.jpeg', 'rishabhjainblog1image4.jpeg', '2020-06-03', 2, '<h2>2. LOST</h2>\r\nIf Breaking Bad was never to be made or if we lived in a world without the existence of Breaking Bad, LOST would have been the Greatest TV Series of all time. And this is not a judgement made by me, but what the critics and readers have to say about the show, throughout the globe. Oceanic Flight 815 crashes on an island with some passengers surviving. But here is the catch, the island seems to have no existence on the world map. Will they be rescued? You need to have intense patience to know this because this is one of the biggest series ever created with 6 seasons and nearly 120 episodes, each episode having a run-time of 50 minutes approx. The show was credited to have the most expensive pilot episode costing over $14 Million (in 2005). If you are in for a big commitment, go check out its trailer or rather the first episode itself right now!\r\n<h2>3. Video Game High School (VGHS)</h2>\r\n\r\nImagine if there was a Hogwards like school, but for videogames. I have the attention of atleast the boys reading this already. Video Game High School as the name suggests is a High School dedicated for imparting knowledge to students in the fields of Video Games. The show is a light hearted comedy with satirical drama created to mock mainstream drama films and shows. The show revolves around a young boy who wins an online gaming tournament and receives a chance to study at the glorious Institute. It is freely available on YouTube with all of its 20-25 minutes episodes streaming in 720p. A visual delight for sure.', '<h2>4. The Act</h2>\r\n\r\nAny Crime-Drama fans in the house? Here is a treat for you all particularly. The Act is an American show based on a true case which goes by the name of Dee Dee Blanchard Murder Case , based on a mother creating an aura of fake illness of her daughter for the sake of getting satisfaction of taking care of her. This illness, Factitious disorder imposed on another (FDIA), is a condition where a caregiver creates the appearance of health problems in another person, typically their child. This may include injuring the child or altering test samples. They then present the person as being sick or injured. This occurs without a specific benefit to the caregiver apart from gaining attention of the world which gives a sense of satisfaction to the care-giver. Sounds twisted enough already? Well, all Ill say is go watch it for yourself.\r\n<h2>5. Wild Wild Country</h2>\r\n\r\nYou might have heard about this show boom when it came out back in 2018. But did you watch it? Well, if not here is why should you watch it ASAP. Based on an Indian Guru Bhagwaan Rajneesh, fondly known by the name of Osho, Wild Wild Country is a docu-drama series created on the life of this controversial individual who was banished from India, but went on to create his own dystopian city Rajneeshpuram in the United States. He esatblishes his cult over there and gains a lot of followers who worship him. But guess what, he is not the protagonist of this show. The centre of attraction is his then Secretary Maa Anand Sheela, who was regarded as most controversial female in United States, at that time. Throughout the show you will only see yourself in a complete awe as to how these two went on to run the biggest non religious cult in the whole world and how they were later accused to plan a bio-terrorist attack, rig an election and even plot a murder of a US Federal Agent. \r\n', '<h2>6. Mr Robot </h2>\r\n\r\nAnother show you might have heard about. Mr Robot, a psychological and techno thriller is based around a young individual who is a cybersecurity engineer by day and an activist hacker by night named Elliot Alderson. Alderson is then hired by an anarchist, who goes by alias of Mr Robot, to work with a group of hackers like him. The show was highly rated and was critically acclaimed for its unconventional screenplay, thought provoking plot and a dark theme. The show has four seasons and each episode is titled in a very unique way. The director of this show Sam Esmail, happens to give a very satisfying ending to this show which is well deserved. Before you proceed to watch, let me warn you a couple of things. First being, that even you might hear voices in your brains just like the lead protagonist and Secondly,while you reach the end if the second season, you make feel like your mind is playing games on you. Because Control is an illusion. With the advent of the famous hacker group Anonymous being very active today, you definitely dont want to miss out on a show which is based on them!', 'This is our list of 6 shows you should definitely give a watch if you havent. So maybe stop rewatching FRIENDS or The Big Bang Theory or The Office.<br> \r\nNo, not The Office. That show is a human treasure.\r\n', 'rishabhjainblog1image5.jpeg'),
(12, '5 must try exercises for beginners', 'Struggling to keep yourself fit while being busy with the assignments?\r\n<br>Being a student comes with a lot of responsibilities, but one of which you shouldn\'t avoid your health\r\n<br>Here are 5 easy exercises that can help you with keeping yourself fit\r\n\r\n<br><h2>1. Lunges</h2>Challenging your balance is an essential part of a well-rounded exercise routine.  Lunges do just that, promoting functional movement, while also increasing strength in your legs and glutes.\r\n<br><h3>STEPS</h3>\r\n1.Start by standing with your feet shoulder-width apart and arms down at your sides.\r\n<br>2.Take a step forward with your right leg and bend your right knee as you do so, stopping when your thigh is parallel to the ground.  Ensure that your right knee doesnâ€™t extend past your right foot.\r\n<br>3.Push up off your right foot and return to the starting position. Repeat with your left leg. This is one rep. Complete 10 reps for 3 sets. \r\n\r\n<h2>2. Pushups</h2>Drop and give me 20! Pushups are one of the most basic yet  effective bodyweight moves you can perform because of the number of muscles that are recruited to perform them\r\n<br><h3>STEPS</h3>\r\n1.Start in a plank position. Your core should be tight, shoulders pulled down and back, and your neck neutral.\r\n<br>2.Bend your elbows and begin to lower your body down to the floor.  When your chest grazes it, extend your elbows and return to the start.  Focus on keeping your elbows close to your body during the movement.\r\n<br>3.Complete 3 sets of as many reps as possible.  If you canâ€™t quite perform a standard pushup with good form,  drop down to a modified stance on your knees â€” youâ€™ll still reap many of the benefits from this exercise while building strength. ', 'Fitness; Gym', 'dipikachetwaniblog1image1.jpg', 'dipikachetwaniblog1image2.jpg', 'dipikachetwaniblog1image3.jpg', 'dipikachetwaniblog1image4.jpg', '2020-06-04', 6, '<h2>3. Squats</h2>Squats increase lower body and core strength, as well as flexibility in your lower back and hips.  Because they engage some of the largest muscles in the body, they also pack a major punch in terms of calories burned.\r\n<br><h3>STEPS</h3>\r\n1.Startby standing straight, with your feet slightly wider than shoulder-width apart, and your arms at your sides.\r\n<br>2.Brace your core and, keeping your chest and chin up, push your hips back and bend your knees as if youâ€™re going to sit in a chair.\r\n<br>3.Ensuring your knees donâ€™t bow inward or outward, drop down until your thighs are parallel to the ground,  bringing your arms out in front of you in a comfortable position. Pause for one second, then extend your legs and return to the starting position.  Complete 3 sets of 20 reps.', '<h2>4. SITUPS</h2>Although they get a bad rap as being too basic, situps are an effective way to target your abdominal muscles.  If you have lower back problems, stick with a crunch, which requires just your upper back and shoulders to lift off the ground.\r\n<br><h3>STEPS</h3>\r\n1.Start by lying on the ground on your back with your knees bent, feet flat, and your hands behind your head.\r\n<br>2.Keeping your feet glued to the ground, begin to roll up from your head, engaging your core throughout.  Donâ€™t strain your neck during the upward motion.\r\n<br>3.When your chest reaches your legs, begin the controlled phase back down to the starting position.  Complete 3 sets of 15 reps as a beginner.', '<h2>5. Side Planks</h2>A healthy body requires a strong core at its foundation, so donâ€™t neglect core- specific moves like the side plank.  Focus on the mind-muscle connection and controlled movements to ensure youâ€™re completing this move effectively.\r\n<br><h3>STEPS</h3>\r\n1. Lie on your right side with your left leg and foot stacked on top of your right leg and foot.  Prop your upper body up by placing your right forearm on the ground, elbow directly under your shoulder.  <br>2.Contract your core to stiffen your spine and lift your hips and knees off the ground, forming a straight line with your body.  <br>3.Return to start in a controlled manner. Repeat 3 sets of 10-15 reps on one side, then switch. ', '', 'dipikachetwaniblog1image5.jpg'),
(9, 'Beginners Fitness Guide', '<h2>Rule 1: Set a Goal</h2> Your fitness journey needs you to first set a final goal and a time frame reasonable enough for you to get there.Once thatâ€™s done using short term mini-goals you will reach there.Also keep in mind your final goal needs to be pragmatic and achievable in that time frame.', 'Fitness; Gym', 'parthgiteblog1pic1.jpeg', 'parthgiteblog1pic2.jpeg', 'parthgiteblog1pic3.jpeg', 'parthgiteblog1pic4.jpeg', '2020-06-04', 5, '<h2>Rule 2: Identify your body type</h2> The next crucial step to success is to know your body and where you stand.Every person has a specific body-type which is genetical or a by-product of your habits.They are majorly classified into:  Ectomorph   Mesomorph  Endomorph', '<h2>Rule 3:Choose a training program</h2> The next crucial step would be to select an appropriate training program. A range of workout disciplines exist and you need to identify the one that suits you best. Each one has its pros and cons so you need to carefully analyse these keeping your end goal in mind.I will list down the major workout/fitness regimes.Look them up and select one!! Weight-training Strength-training  Cross-fit Calisthenics  Aerobics', '<h2>Rule 4:A perfect diet-plan</h2> Trust me this is going to be the corner-stone of your fitness journey. No training program will seem to work if your diet isn\'t spot on.Once you complete the above steps you will have yourself a rough idea of what your diet should look like.The best diet is the one you yourself tailor-make.Although It is advisable to consult an expert on matters such as supplementation.The key to unlock the BEST diet plan is to learn the math behind calories! A diet needs to be followed diligently.Do not be hasty and choose diets that give quick results because that\'ll doom you on the longer run.', '<h2>Rule 5:Track your progress</h2> You should ideally check your fitness progress monthly or every fortnight.This helps you understand the process and if the diet plan/training program is working. Moreover you identify your weaknesses this way and can address them sooner.Also you yourself need to be the examiner and never let a third person judge or track your progress.Keep in mind this is a slow process and results take time.Let the slightest progress cheer you up!!', 'parthgiteblog1pic5.jpeg'),
(10, 'Money making instruments every teenager should know', 'Legendary investor Warren Buffett defines investing as \"â€¦the process of laying out money now to receive more money in the future.â€ the goal of investing is to put your money to work in one or more types of investment vehicles in the hopes of growing your money over time. However, it also comes with the risk for losses depending upon the instrument and securities in which you make investment. We are going to discuss here explore the best investment instruments to invest in the ascending order of their returns with very low or no risk', 'Finance; Investment', 'sandeepyadavblog1headerimage.jpg', 'sandeepyadavblog1image1.jpeg', 'sandeepyadavblog1image2.jpeg', 'sandeepyadavblog1image3.jpeg', '2020-06-04', 4, '<h2>1. Traditional instruments</h2> When we talk about traditional instruments the first things which comes in our mind is Fixed deposit (FD) but you know there are ample of other investment like KVPY, RD, LIC who also claim to give the same returns of 6-8 percent. Even the G-sec bonds (securities issued by government of India to raise money by giving some amount of return per year), treasury bills kind of investment which is also a risk free investment gives the same 6-8 percent returns over the long time frame. Since these are the traditional instruments so many of you claim at least these are risk free investment which give ample amount of return but when you perfectly calculate tax deduction and exemptions you better get to know that these instruments after adjusting to present inflation rate give 1-2 percent returns . So, next time when you think of investing in FDs donâ€™t rush to do before thinking carefully since in these new investing era of 20th century we have other instruments which give far good adequate return as compared to Traditional investment', '<h2>2. Sovereign gold bond</h2> Importing Gold affects the economy by raising our fiscal deficts. But, people are obsessed with gold in India. However, there exists a way through which people can invest in gold, reap benefits and also, India doesnâ€™t have to import for that. Weâ€™re referring to Sovereign Gold Bonds. Investing in these bonds is the smarter way of gold investment. However, if youâ€™re obsessed with gold jewelry, this doesnâ€™t apply to that. Sovereign gold bonds are issued by the Reserve Bank of India (RBI) on behalf of the government, this is not a risky investment to be afraid to invest. Gold bonds offer an annual interest rate of 2.50% to investors additionally from capital appreciation (increase in price value). When you purchase a gold bond, you just have to comply with the lock-in period (which is of mainly five years) and your deposit gets its value based on the gold price post the lock-in period is over. So, if the prices soared, youâ€™ll receive returns accordingly and by chance, if the price went down, the value of your deposit will be adjusted accordingly. These bonds have given the returns of 12% over the period of time', '<h2>3.Mutual funds</h2> Have you ever thought about investing in mutual funds? They have been there for more than 30 years. However, increasing incomes over the years, reduced bank deposit rates, demand of market, and awareness among investors have led to immense popularity of mutual funds as an investment instrument. People prefer to invest in mutual funds mainly because of the higher returns as compared to other government schemes and security. many of you know it by simply coming through the ad campaign \" Mutual fund sahi hai\".so let me tell you how it works ,these mutual fund investment institutions(AMCs) collect money from common people like you and me. The money thus acquired is then invested in various streams that would get you returns. At the end of the period for which you invested, the mutual fund management company will return the amount you\'ve invested along with the gains earned. This is otherwise known as the maturity amount. It is effectively managed by an expert who has good knowledge about the market. However, they will deduct roughly about 1-3 % from the returns as a fee. Mostly their returns range from 11% to 25% as according to the schemes you invest in it', '<h2>4.Passive Investing(Index Investing)</h2> You know that over the decades Indian stock market(Sensex) has given the returns of 17 percent which is compounded annually. Inshort it means your investment get doubled after every 4.3 years over the decades. In the same period, gold gave a rupee return of 10%. So letâ€™s see what is actually passive investing and how can we take good profits by doing these Passive investing uses market-weighted indexes and portfolios to invest funds and avoid many of the fees common to more active investment strategies. basically it is the investment in the stock market on some selected group of stocks by National stock exchange (NSE) or Bombay stock exchange (BSE) ex. Nifty50 ETFs, Sensex30 ETFs etc.   Passive investment is cheaper as the stocks pick by market so there is no fund manager to do research and demand fess in exchange, less complex, and often produces superior after-tax results over medium to long time horizons than actively managed portfolios. (Mutual funds)', 'sandeepyadavblog1image4.jpeg'),
(11, 'HOW TO INTRODUCE YOURSELF (this is different)', 'Before reading this article, why do you need to know â€œhow to introduce yourself?â€ Are you here to make an introduction of yourself interesting? Or are you here to use those titles that you might not even mean?\r\n<br>\r\nPretty much this article is not about giving you contents to your introduction. Its just a review of how you can frame who you are and what you do in better way. So, who you are and what you do is a personal subject to explore, (for Godâ€™s Sake, do not search for who you are in articles!)\r\n<br>\r\nBut what is an introduction? Is that a repetitive speech? Does that imply the same everywhere? Do you introduce yourself with same exact words when you are up for an interview and when you are at relativeâ€™s place? Or worse, you have worked so much on your resume for your career, that you have no idea how to introduce yourself at a party? Or were you going to impress someone with your technical skills? Lets take a look at some of the points:\r\n<br>\r\n<h2>1. Be interesting</h2>This is one of the factors you really need to work on. Why would someone be interested in listening to your boring speech. Even if you have your own opinions, maybe they are brilliant but if no one listens whatâ€™s the point in saying. So, make your introduction interesting. Use simple words. If the conversation is informal, you may add your personal touch as to why you do something, what drives you to do something. People around you, always love that personal connection. If the conversation is formal, you may make it very simple as to what you do and how it helps yourself and others.', 'Self-Confidence; Introduce', 'maitrimarublog1headerimage.jpeg', 'maitrimarublog1image1.jpeg', 'maitrimarublog1image2.jpeg', 'maitrimarublog1image3.jpeg', '2020-06-04', 3, '<h2>2. Short & exciting.</h2> Again, people might read a 250-page long book but might not understand even a paragraph. So, whatever is the content it must be exciting. Make them think â€œWhatâ€™s more?!â€ But again, lets say for example, you could be good at writing, thereâ€™s no need to specify that you write poetry, blogs, newsletter. Keep it simple and use single word. If other person finds it interesting, you would be there with a next follow up question. Or you know coding languages, no need to specify all the languages you know. If the person is aware of those languages, you might get a follow up question and if the person is not aware of any languages, your extra words are just making the conversation boring and forceful.', '<h2>3. Be relatable</h2>  Context really matters. Its not something, that one asks you to introduce yourself and you start that speech which you have prepared so hard. Who would want to know what you excel at, at a party! Or how using those great words, skills in front of your relatives (maybe to impress them) who donâ€™t even understand a single word. Speak the same language! And definitely here a translator wont help. Speak according to your environment. â€œCatch attention in few secondsâ€', '<h2>4. Follow-up question</h2>  This always works when thereâ€™s a two-way communication, not interviewer-interviewee relationship. So, this works when you are having an informal chat. Always have some follow- up question at the end of your statement. This might be asking the other person about their hobbies, how their work is helping them and the society. Avoid any sensitive topics or one where you might have differences. If you disagree with someone, you may make your point, but donâ€™t be too harsh or try to change that personâ€™s thinking. If making your point doesnâ€™t go well, just change the topic. And if you really want to make a difference, just write a blog! Avoid discussions on politics, religion. Focus more on open-ended questions.', '<h2>5. Donâ€™t say too much</h2> \r\nBe short and concise. Be it in your emails or face to face conversations. Have a one sentence pitch ready, which might work at almost every place â€œwho you are and what you doâ€œ. Know the difference when to use your title and companyâ€™s name. If it doesnâ€™t matter or is not necessary, avoid it. You might just end up flaunting.\r\n<br> \r\nSo, this can be the flow.\r\n<br>\r\ni. A short sentence with â€œwho you are and what you doâ€œ.\r\n<br>\r\nii. A follow-up question to the other person. \r\n<br>\r\niii. Engaging in an authentic conversation, by asking what other personâ€™s goals are, or what \r\nthey look forward to\r\n<br>\r\niv. Talking about what drives you crazy. Sharing your story. \r\n<br>Well, introductions can be classified: \r\n<br>a. Emails\r\n<br>b. Social media\r\n<br>c. Informal (face to face)\r\n<br>d. Interview\r\n<br>e. Presentations\r\n<br>f. Party \r\n<br>Avoid mentioning your age. How you carry a conversation matters, not the age \r\n<br>You may talk about hobbies when you are at a party. â€œHi, I am Maitri. I am Adityaâ€™s music class friend. (the birthday boy!!!). How do you know Aditya?â€œ\r\n<br>When in a formal conversation, â€œHi, I am Maitri. I do this for a living, what do you doâ€œ or â€œHi, I am Maitri. I am about to graduate/working for X company for Y years, what do you doâ€œ \r\n<br>When you are likely to attend any professional event or an event where people come from different backgrounds, you can have a basic conversation of who you are, where you are from (a place can be a start point to a great conversation) â€œHi, I am Maitri. I am from ABC/ I am originally from ABC but I have been living in PQR since X yearsâ€œ and then let the conversation start. \r\n<br>If you want to build a relationship, ask a follow-up question. \r\n<br>Be concise while writing an email. Forget those school methods. We, young people really need to know, how to write emails. There are so many emails a firm receives, its unlikely to read all the emails. So, hoping that they read your best lines, focus on how they will just open your email. Talk about their interest, not yours. First give, then take. \r\n<br>Assuming that two people follow each other on social media, you can strike a conversation with â€œHey! I have been following you for a couple of days/weeks. I want to ask you a question. Do you ____?â€œ or its been a long time you havenâ€™t talked to your friend. â€œHey! Its been a long time we met/chatted. How have you been?â€œ \r\n<br>Talking about presentations, which is more likely a one-way communication, donâ€™t just start with a presentation. Introduce yourself, always. Maybe you can use less words and just add a slide about who you are and what you do (again less words to speak doesnâ€™t mean more words to read in a slide!) Greeting with a picture of yours. Or a special quote from your native place (just to add a little bit of humor, this should not be used everywhere) or presenting your skillsets in diagrammatic way in a slide. \r\n<br>Interview: Itâ€™s likely that your resume has been already read once. So, donâ€™t be repetitive. When given chance to speak something outside the resume about yourself. Give a little hint about your personality and what interests you and what does not. Because, the way you speak makes a difference in impact than simply writing it on the Resume. \r\n<br>I would conclude, â€œBuild your resume, but resume is not the only identity you have. Resume is just a part of your identityâ€œ Ask yourself, how will you make friends in a school, with your bench partner (did you even know what resume was then) How will you introduce yourself, when you retire? How will you introduce yourself, when you are on a vacation? \r\n<br>This article is not a spoon feed, itâ€™s more than that! Its more about knowing yourself. Its about exploring yourself. It is finding an answer to <h3>â€œwho you are?â€œ</h3> and <h3>â€œwho you really want to be known as?â€œ.</h3> ', 'maitrimarublog1image4.jpg');
