(1, 'Sweta Panchamia', 'Sweta Panchamia is a 21 year old upcoming fashion designer. Although she doesn\'t have a fashion background, that has never stopped her from designing/styling clothes from a very young age for her family and friends. She is a next door bubbly girl who loves to share her fashion tips and ideas with everyone. Recently she started with her fashion blog and we know for sure that she still has a lot of places to go in future!', 'swetapanchamia.jpeg', 'https://www.instagram.com/herstylediaries/'),
(2, 'Rishabh Jain', 'An Engineering student on a quest to satisfy his creative keedas. A Topical writer by passion, Rishabh likes to write on issues and topics that make people think and also make them weirdly laugh over it. Check out his Instagram handle(@kanjoos_maarwaadi )to know what weird stuff he\'s upto every other day.', 'rishabhjain.jpeg', 'https://instagram.com/kanjoos_maarwaadi?igshid=uqzoxtfru4pm'),
(3, 'Maitri Maru', 'I am Maitri Maru. I am interning as a Marketer and a content writer. I am pursuing engineering in Information Technology. I have been writing articles on self which adds values to life. I am a reader. I draw often. I am working on one big project -- working on myself, to become a better human, which can help me serve society with my strengths.', 'maitrimaru.jpeg', 'https://instagram.com/books_in_black?igshid=1jpkg8wv6pufh'),
(4, 'Sandeep Yadav', 'A budding investor and a certified Research Analyst from NISM with keen interest in Finance and economics', 'sandeepyadav.jpeg', 'https://www.linkedin.com/in/sandeep-yadav-21a136170'),
(5, 'Parth Gite', 'Parth Gite is a 22 year old bodybuilding professional. He has successfully participated in various competitive bodybuilding events and has had an incredible Natural body transformation journey. Sports nutrition and weight training are his forte. A final year Engineering student based out of Mumbai,he believes that bodybuilding needs to be guided by science and building a respectable body w/o using any forms of steroidal drugs and supplements is very much possible. ', 'parthgite.jpeg', 'https://www.instagram.com/parthjaydeep/'),
(6, 'Dipika Chetwani', 'Digital marketing enthusiast and a part time writer,singer!', 'dipika chetwani.jpeg', 'https://instagram.com/dipikkkka?igshid=lq0171a86ykg');
