INSERT INTO `brainheaters` (`id`, `name`, `mobile`, `email`, `college`, `city`, `course`, `title`, `description`, `category`, `assignment type`, `assignment_level`, `subject_tags`, `deadline`, `time`, `date_of_submission`, `budget`, `filename`, `project_manager`, `freelancer`, `posted`, `under_process`, `assigned_to_pm`, `assigned_to_freelancer`, `confirmed`, `review_recieved`, `bh_posted`, `bh_likely`, `bh_converted`, `bh_lost`) VALUES
(19, 'Shubham Khairnar', '8452913433', 'klinux097@gmail.com', 'A P Shah', 'Thane', 'BE IT', 'Chatbot for farmers', 'A farmer chatbot using rasa framework which must includue multilingual support. Chatbot must answer farmers basic queries ', 'Major Project', '[\"Other\"]', 'Bachelors', '[\"AI,Rasa chatbot,Marathi Language\"]', '2022-02-28', '14:01', '', 'NULL', '_$_', '6', NULL, 1, 0, 0, 0, 0, 0, 1, 1, 0, 1),
(20, 'Onkar Kadam', '9987070426', 'onkark071@gmail.com', 'Datta Meghe College of Engineering', 'Thane', 'Other', 'IOT based Social Distancing and Monitoring Robot for queue', 'The robot consists of a 4 wheel design system used to drive the robotic vehicle. It makes use of a line following principle to constantly move along with the queue and monitor for social distancing violations. The robotic uses IR sensing to travel along with the queue to and fro in order to detect violations. The robot is now equipped with obstacle detecting ultrasonic sensor in order to detect obstacles in the vehicle path.\r\nThe robotic vehicle uses another ultrasonic sensor for detecting distance between 2 individuals in a queue. It any 2 individuals are found having less than 3 feet distance between them, the robot instantly sounds a buzzer and alert to inform about the violation. Also it sends alerts of these violations along with a camera picture using wifi over iot to inform the higher authorities/head office to update them about violations with proof so instant disciplinary action can be taken.\r\nThus this project allows for automatic maintaining social distancing in queues to help prevent spread of the virus.', 'Major Project', '[\"Other\"]', 'Bachelors', '[\"Final year project\"]', '2022-03-11', '10:30', '', 'NULL', 'SOCIAL DISTANCING & monitoring-converted.pdf_$_', NULL, NULL, 1, 1, 1, 1, 0, 0, 1, 1, 1, 0),
(21, 'Mufaddal Shakir', '8879296510', 'hozefashakir28@gmail.com', 'Mohammad Haji saboo siddik college of engineering', 'Mumbai', 'Other', 'Mathematical modelling and simulation of suspension system in matlab/Simulink', 'This is the final year project of B.E automobile engineering. We have to create a mathematical model of suspension system of a car ( Half car, quarter car, Semi-car model) in matlab/Simulink. We want the complete file which we can open in our matlab software. We also want project report and PPT of the project according to mu guidelines. I have attached project file below for reference. We want our project somewhat similar to that pdf attached but better than that.', 'Major Project', '[\"Other\"]', 'Bachelors', '[\"Chassis design\"]', '2022-01-28', '12:00', '', 'NULL', 'analysis-and-design-of-vehicle-suspension-system-using-matlab-and-simulink.pdf_$_', NULL, NULL, 1, 0, 0, 0, 0, 0, 1, 0, 0, 1),
(22, 'Vivek Patil', '9702862261', 'patilvivek2261@gmail.com', 'Konkan Gyanpeeth College of Engineering ', 'Karjat', 'Other', 'Food waste composting machine ', 'Now a dayâ€™s food waste is one of the major problem. So the objective of these project design\r\nand fabrication of food composting machine that is used to recycle and treat liquid and solid \r\nfood waste. These machine dispose food waste and produce natural fertilizers, which can be \r\nused for organic farming.\r\n', 'Major Project', '[\"Other\"]', 'Bachelors', '[\"Food analysis\"]', '2022-02-17', '12:00', '', 'NULL', 'inbound3380990101736948558.pdf_$_', '4', NULL, 1, 0, 0, 0, 0, 0, 1, 1, 0, 0),
(24, 'Harshal', '8425930494', 'harshal2209@gmail.com', 'KGCE', 'Karjat', 'BE Computer', 'HOMEHANDY', 'Homehandy is online app for local services such as repair & maintenance, home cleaning, homecare & design, pest control, packers & movers, business health & wellness, salon, etc.\r\nBackend :- node.js express\r\nDatabase :- mongoDb\r\nFrontend:- react native', 'Major Project', '[\"Other\"]', 'Bachelors', '[\"App Development\"]', '2022-03-15', '12:00', '', 'NULL', 'inbound3085467779099607844.jpg_$_', '2', NULL, 1, 0, 0, 0, 0, 0, 1, 1, 0, 1),
(25, 'Selas Moro', '8369420471', 'selmoro31@student.sfit.ac.in', 'St. Francis Institute of Technology', 'Mumbai', 'BE Computer', 'Traffic Rules Violation Detection ', '\r\nIntroduction:\r\n\r\n The increasing number of cars in cities can cause high volume of traffic, and implies that traffic violations.\r\n\r\nTo overcome this problem we\'ll be building Traffic violation detection systems using computer vision which is very efficient tool to reduce traffic violations by tracking and Penalizing.\r\n.\r\nThis system can detect traffic violation in real-time which are signal violation, parking violation and wrong direction violation. \r\n\r\nProposed Solution:\r\nThe goal of the project is to:- \r\na)Automate the traffic rules violation detection system.\r\nb)Detecting and tracking the vehicle and their activities accurately.\r\nc)Take action against the violated vehicle owner in a fast and efficient way.	\r\nThe implementation of real-time traffic rule violation detection is done by monitoring stream.\r\nConventionally vehicle detection is referred as an object detection problem but to detect a moving vehicle, image processing is used.\r\nCheck whether vehicle is breaking any of the rules listed in the program.\r\n\r\nSystem Overview:\r\nLibraries in use for graphical user interface: \r\n1. PyQt5 5.12.3\r\n2. QDarkStyle 2.8\r\n3. PyQtTimer \r\nDatabase implementation:\r\nLibraries in use for database management:\r\n 1. Sqlite3 \r\n 2. Enum(future-python)  \r\n', 'Major Project', '[\"Programming/Coding Assignment\"]', 'Bachelors', '[\"Machine Learning,Image Processing\"]', '2022-04-15', '11:15', '', 'NULL', '_$_', '2', NULL, 1, 1, 1, 1, 0, 0, 1, 1, 1, 0),
