(42, 'Riya', '9082591399', 'rishiriyakanikudiyil@gmail.com', 'A P Shah institute of technology', 'Thane', 'Other', 'Intelligent traffic management system for smart cities', 'Traffic congestion is a major problem especially in smart cities due to increasing growth of population and vehicles. Congestion in smart cities is going to increase in future and there is a need to resolve it. Current traffic management system is not capable to cope up with this. In this paper, we propose an Intelligent Traffic Management system which will collect and process real time traffic data to reduce traffic congestion and predict optimal route. This will improve time management and traffic flow in areas affected by traffic congestion. This system will help citizens save time especially during peak hours. This research focuses on using current technologies and materials that will be cost effective and readily available to provide optimal traffic flow and reduce travel time. This research will be able to improve traffic flow in smart cities. It will also help in reducing accidents, greenhouse gases, air pollution and prove optimal route. ', 'Major Project', '[\"Research Paper\"]', 'Bachelors', '[\"Traffic engineering,Transportation Engineering\"]', '2022-02-20', '09:00', '', 'NULL', 'Format for dissertaion report B.E_VII.docx_$_', '6', NULL, 1, 0, 0, 0, 0, 0, 1, 0, 0, 1),
