(44, 'seeman ansari', '09892454189', 'seemanansari0@gmail.com', 'Rizvi college of engineering', 'mumbai', 'Other', 'Automated temprature checking device for entrance', 'there is only literature survey on this topic conducted by the \r\nDepartment of Electronics and Communication Engineering\r\nKakatiya Institute of Technology and Science, Warangal India\r\n\r\nthey had worked on  these project but there project is limited as it can only detect the temperature and open the gate for the person through servo motor \r\nand we can only set a particular temp in it for changing that temp we have to chnge in the code of arduino \r\nwhat we have done is or advanced it that we can set we make use of a laser diode and receiver to detect the entrance of a person, when the project detect entrance it will check the temperature of the person if the temperature is less than the set temperature the person is allowed entry otherwise the entry is denied. \r\n\r\nOnly a pre-determined number of people are allowed in the room. The allowed temperature, the number of people allowed in the room as well as the number of people actively present in the room can be set/viewed using a Bluetooth App.\r\nfor this we r using \r\nhc05 bluetooth module if we set the no. of people to 5 then it doesn\'t matter the temp of 6th person is below the set tem it wont open for him \r\nif someone from inside go outside of the room then automatically it shows that there is 1 vacancy inside only 1 person can enter \r\n\r\nour aim for this project is to advance it as in that we can\'t control the no. of persons entering or going out of the room and in our model we can control the no . of people \r\n', 'Major Project', '[\"Programming/Coding Assignment\",\"Research Paper\",\"Review Article\",\"Other\"]', 'Bachelors', '[\"Robotics and AI,Robotics and Simulation\"]', '2022-02-20', '12:00', '', 'NULL', 'Auto Temperature Detector for Entrance For Covid Safety.doc_$_', NULL, NULL, 1, 1, 1, 1, 0, 0, 1, 1, 1, 0),
