(51, 'Rohit Dharnaik', '8830265361', 'dharnaikrohit@gmail.com', '  St. John College of Engineering & Management', 'Vasai-Virar', 'Other', 'Impact of Material Flow & Process on Operating Cost of Companyâ€', 'it is a research/survey based project. we have to collect data from industry and then we have to present the output of like what we can do to improve material flow and where can we reduce cost.', 'Major Project', '[\"Research Paper\",\"Review Article\"]', 'Bachelors', '[\"Mechanical,Material management,Material Balance Analysis,Production Planning,Product Management\"]', '2022-02-28', '16:30', '2022-01-21 04:02:00', 'NULL', 'material flow process and its impact on cost PPT B22.pptx_$_', '2', NULL, 1, 0, 0, 0, 0, 0, 1, 0, 0, 1),
(52, 'Tejas V Adhav', '07304344430', 'tejasadhav69@gmail.com', 'Terna Engineering College', 'Dombivli', 'BE Computer', 'Understand Design Patterns in C', 'In this task you shall develop the understanding of basics of design patterns in C. The task will help you understand the basics of API design and introduce you the though process required for writing industrial grade  reusable code. You shall create an abstract API for matrices (you aren\'t supposed to implement the API). You shall create the API for matrix. Following operations shall be supported by your API.\r\n\r\ncreate, delete, property access (think what properties you shall expose), various operations (this is something which will reflect your own understanding of matrices).\r\n\r\nThe operations you will expose will also reflect on your understanding of the design pattern.', 'Major Project', '[\"Programming/Coding Assignment\"]', 'Bachelors', '[\"C programming\"]', '2022-01-24', '09:00', '2022-01-21 04:39:02', 'NULL', '_$_', '4', NULL, 1, 0, 0, 0, 0, 0, 1, 0, 0, 1),
(53, 'Rishikesh Sandeep  Patil', '7774048540', 'rishiofficial1820@gmail.com', 'Terna engineering college', 'Nerul', 'Other', 'People Management System using UWB Tags.', 'A system to manage people working in a factory. Ensuring they are within the factory and also in the correct location within factory as per their job.\r\n1.Employees can track their location and can communication with other .\r\n2.Employees and administrator will have record of attendance\r\n3.Administrator can notify Employees of their excess stalling activities with either with a warning alert/message beep.\r\n4.Administrator can efficiently keep a track record of the employees present in the factory premises & keep track of employees entry/exit details.', 'Major Project', '[\"Programming/Coding Assignment\",\"Research Paper\",\"Review Article\",\"Other\"]', 'Bachelors', '[\"Final year project,Electronics and communication engineering\"]', '2022-03-01', '14:00', '2022-01-21 09:17:04', 'NULL', 'Screenshot (397).png_$_', '4', NULL, 1, 0, 0, 0, 0, 0, 1, 0, 0, 1),
(54, 'Rishikesh Sandeep  Patil', '7774048540', 'rishiofficial1820@gmail.com', 'Terna engineering college', 'Nerul', 'Other', 'People Management System using UWB Tags', 'A system to manage people working in a factory. Ensuring they are within the factory and also in the correct location within factory as per their job.\r\n1.Employess can track each other location and communicate with each other\r\n2.Employess and administrator will  have record of there attendance.\r\n3.Administrator can notify Employees of their excess stalling activities with either with a warning alert/message beep.\r\n4.Administrator will be able to know entry/exit of worker in factory premises.', 'Major Project', '[\"Programming/Coding Assignment\",\"Research Paper\",\"Review Article\",\"Other\"]', 'Bachelors', '[\"Final year project,Electronics and communication engineering\"]', '2022-03-01', '14:00', '2022-01-21 09:26:33', 'NULL', 'Project submission details.png_$_', '6', NULL, 1, 0, 0, 0, 0, 0, 1, 0, 0, 1),
(55, 'Dikshita Mhatre', '8237476592', 'dikshitam@sjcem.edu.in', 'St. John College of Engineering and Management', 'Palghar', 'BE Computer', 'Transparent Charity System using Smart Contracts on Ethereum using Blockchain ', 'The charity system mode proposed is shown in the Figure below. There are four roles: donors, beneficiaries, charity organizations and cooperative stores. The charity organizations get the information of seek help and create charity projects through the platform. Donors learn about charity projects on the platform, then donate to beneficiaries or the charity organizations. Beneficiaries upload their information to the platform for help, they can get and spend tokens in cooperative stores. The transactions occurred in the stores will be uploaded to the charity platform. The cooperative stores supply services or goods to the beneficiaries to obtain tokens. The tokens can be exchanged for real money by charity organizations.The flow of funds has been fully recorded on the blockchain, which allows transactions to be tracked and funds prevented from being abused. Beneficiary initiates a charity project in the DApp.\r\nBeneficiary requests funds from the charity project initiated by himself.\r\nDonor donates to the charity projects which he chooses.\r\nDonor is able to vote on the funding request for the charity project already participated.\r\nAfter the request for funds is approved, the funds are automatically transferred to the beneficiary\'s account.', 'Major Project', '[\"Programming/Coding Assignment\"]', 'Bachelors', '[\"Blockchain\"]', '2022-02-15', '12:00', '2022-01-21 23:48:14', 'NULL', 'Transparent Charity System using Smart Contracts on Ethereum using Blockchain .pdf_$_', '4', NULL, 1, 0, 0, 0, 0, 0, 1, 0, 0, 1),
(56, 'Ritesh', '7845795127', '2000riteshagarwal@gmail.com', 'Smt. Indira Gandhi College of Engineering', 'Mumbai', 'BE Computer', 'Insurance application using blockchain', 'Simple application with accessible from Web browser which shows the height of blockchain with hashcode to the user of blockchain\r\nFor eg : https://github.com/IBM/build-blockchain-insurance-app', 'Major Project', '[\"Programming/Coding Assignment\"]', 'Bachelors', '[\"Blockchain,Blockchain application development\"]', '2022-03-01', '18:00', '2022-01-22 07:28:03', 'NULL', '_$_', '4', NULL, 1, 0, 0, 0, 0, 0, 1, 0, 0, 1),
(57, 'Rupesh Jatav', '9604835015', 'rupeshjatav22@gmail.com', 'St francis institute of technology', 'Vasai-Virar', 'Other', 'Virtual Laboratory for optical fibre communication using IoT and LabVIEW software.', 'Our objective is to remotely operate optical fiber-based devices through Virtual Lab with the help of IoT and LabView Software. In this project, we have to create a virtual lab with the help of Arduino and a potentiometer which will be controlled by blynk app,etc. The potentiometer varies the resistance of resistor which is connected across the diode(LED) as the resistance changes across the Led voltage also changes and we have to send various parameters like current, voltage, and resistance to thingspeak. The data obtained on thingspeak(cloud) need to be extracted and plot its V-I characteristics graph on LabVIEW software. the output obtained need to be such that it gives the same output when we use an optical fiber kit.', 'Major Project', '[\"Other\"]', 'Bachelors', '[\"Embedded Systems and Arduino\"]', '2022-02-07', '12:15', '2022-01-22 09:01:05', 'NULL', 'john2012 (1).pdf_$_', '2', NULL, 1, 1, 1, 1, 0, 0, 1, 1, 1, 0),
(58, 'Soham Dagade', '8108545565', 'sohamdagade8198@gmail.com', 'RAIT', 'Mumbai', 'Other', 'SMART CROP PROTECTION AND MONITORING SYSTEM ', 'In this project, we are developing a system which will\r\nautomatically monitor the Crops in farms are many times ravaged by local animals like buffaloes, cows, goats, birds, and fire\r\netc. This leads to huge losses for the farmers. It is not possible for farmers to barricade entire fields or stay on field 24 hours\r\nand guard it. So here we propose automatic crop protection system from animals and fire.', 'Minor Project', '[\"Other\"]', 'Bachelors', '[\"Electronics and communication engineering\"]', '2022-02-04', '10:00', '2022-01-28 09:18:43', 'NULL', '_$_', NULL, NULL, 1, 0, 0, 0, 0, 0, 1, 0, 0, 1),
(59, 'Ishika Guha ', '8959791411', 'guha.ishika.18ee1062@gmail.com', 'DY Patil RAIT ', 'Mumbai', 'Other', 'Solar powered led street lighting system with auto intensity control using microcontroller ', '*Topic : Solar power controlled LED street light with auto intensity control using microcontroller*\r\nâ–¶street light switched on at night and switched off at day automatically\r\nâ–¶different intensities of light at different time of night\r\nâ–¶charge controller to prevent overcharging\r\nâ–¶motion detector to track movement of vehicles along road. \r\n\r\n\r\n*We want to ask you some question*\r\n1)will you make whole model of project? \r\n2)will you give us simulation of project on proteus software? \r\n3)will you make whole report of project? \r\n4) will you buy all components or we should give you the components? \r\n5)do you want circuit diagram or you will make in your way? \r\n6)will you explain the project in detail with the viva question based on project? \r\n7) In how many days you will give us model and simulation? \r\n8) what will be the total cost ?', 'Major Project', '[\"Other\"]', 'Bachelors', '[\"Electronic devices and circuits\"]', '2022-02-14', '16:44', '2022-01-29 22:15:44', 'NULL', 'inbound5214230951830158116.pdf_$_', '2', NULL, 1, 0, 0, 0, 0, 0, 1, 1, 0, 1),
