(113, 'Aditya Sadashiv', '8425898928', 'adisadashiv44@gmail.com', 'SIES Graduate School Of Technology', 'Mumbai', 'BE Computer', 'English to SQL query converison', 'The main aim of our project is to convert the english questions entered by the user and convert it into an SQL query so that he/she easily query a database. We need to use a deep learning model to achieve our goal most preferably two models: bidirectional LSTM and a normal RNN to compare the accuracies and the results between them. We also need the use glove embeddings for the vector representation of words and feed it to the deep learning model. We need to use the spider dataset which contains the pair of english questions and corresponding SQL query. Attached below is the paper we have been referring lately.', 'Major Project', '[\"Programming/Coding Assignment\",\"Research Paper\"]', 'Bachelors', '[\"Deep Learning,Natural Language Processing\"]', '2022-04-01', '10:00', '2022-03-20 10:45:23', 'NULL', 'SSRN-id3437616 (1).pdf_$_', '2', NULL, 1, 1, 1, 0, 0, 0, 1, 1, 0, 0),
