(118, 'Saloni Nikumbh', '8104972059', 'saloninikumbh@gmail.com', 'Lokmanya Tilak college of engineering ', 'Mumbai', 'Other', 'Remote Assistant and virtual manual using AR for home appliances ', 'Our project name is Remote Assistance and Virtual Manual App using Augmented reality. So the first past is Remote Assistance which is a real time video communication which will connect a client or customer to the technician or expert so that they both can see and discuss the problem.Both the users will be able to draw digital annotations on their mobile screen. So whatever mark or points the user1 does on their mobile screen will appear on the user2 screen and vice versa ,this will enable the agents to remotely solve hardware issues. Now the next part is Virtual Manual ,so with this Augmented reality user manual, all the user has to do is scan the machine and see what each button on that machine does. For example a coffee machine-when we scan the coffee machine  it will identify the machine by recognizing it\'s image with machine vision then will provide it\'s id and position which will allow to augment the front panel of machine with virtual manual on our mobile phone.', 'Major Project', '[\"Programming/Coding Assignment\"]', 'Bachelors', '[\"Augmented Reality\"]', '2022-04-03', '09:00', '2022-03-22 02:11:41', 'NULL', 'Synopsis Et-16-7.pdf_$_', NULL, NULL, 1, 1, 0, 0, 0, 0, 1, 0, 0, 0),
