(123, 'Aditya Gaonkar', '8652627987', 'adityasgaonkar@gmail.com', 'MCT\'s Rajiv Gandhi Institute of Technology', 'Mumbai', 'Other', ' Analysis of Novel Multilayer Sandwich Panel Under Three Point Bending Load  ', 'A corrugated-core sandwich structure is the one composed of a corrugation sheet between two thin surface sheets.\r\nThe main role of corrugated-core is to keep the face sheets separated and make the whole structure to resist against vertical deformations like a single plate.\r\n Moreover, unlike other core shapes a corrugated-core bears bending and twisting loads as well as shear. Thus, these kinds of panels are used in aeronautics, aerospace, civil engineering and other applications.\r\nHere the sandwich panels are tested under three point bending load to test their load bearing capacity and energy absorption.\r\nWhile we are performing the bending test on ansys , the pictures of details of the errors faced  by us is been submitted with the documents', 'Major Project', '[\"Research Paper\"]', 'Bachelors', '[\"Design and Analysis of Statistical Experiments,Design and analysis of experiments\"]', '2022-03-26', '23:59', '2022-03-23 10:51:44', 'NULL', 'SECOND-REVIEW-SEM-VII-Presentation-Format 01.pdf_$_', '8', NULL, 1, 1, 1, 0, 0, 0, 1, 0, 0, 0),
