(148, 'Aditya Vijay Mane ', '8433518056', 'adimanx11@gmail.com', 'Rajiv Gandhi Institute of Technology Versova ', 'Kalyan-Dombivali', 'BE Computer', 'Mental health app using flutter ', 'Hey i want to build a mental health app using flutter with recommendation feature suggesting user different songs and movies to over come anxiety, stress or make him happy. With a reward points policy that ranks up the user with each task completed ', 'Major Project', '[\"Programming/Coding Assignment\"]', 'Bachelors', '[\"App Development\"]', '2023-03-31', '10:43', '2023-01-19 11:14:09', 'NULL', '_$_', '14', NULL, 1, 1, 1, 0, 0, 0, 1, 0, 0, 0),
(149, 'Niraj Mohabey ', '9689293504', 'yashrajabhoj@gmail.com', 'Rajiv Gandhi institute of technology ', 'Mumbai', 'BE Computer', 'Plagiarism Detection using ML', 'Want End to end deployed project of plagiarism detector ', 'Major Project', '[\"Programming/Coding Assignment\",\"Research Paper\"]', 'Bachelors', '[\"Machine Learning\"]', '2023-03-15', '12:00', '2023-01-20 01:11:38', 'NULL', '_$_', '14', NULL, 1, 1, 1, 0, 0, 0, 1, 0, 0, 0),
(150, 'Abhay Rangnani', '8007942000', 'rangnaniabhay@gmail.com', 'Thadomal Shahani Engineering College', 'MuMbai', 'BE IT', 'Music recommendation for health', 'We need to build a music recommendation web application. The music should be recommended based on the heart rate of the user. Heart rate can be detected using an IOT device or could also be entered manually, which will be helpful for recommending songs.', 'Major Project', '[\"Programming/Coding Assignment\"]', 'Bachelors', '[\"Machine Learning,IOT\"]', '2023-01-24', '23:00', '2023-01-20 05:00:09', 'NULL', '_$_', '14', NULL, 1, 1, 1, 0, 0, 0, 1, 0, 0, 1),
(151, 'Chandan Gupta', '9326264283', 'guptachandan8320@gmail.com', 'Vidyavardhini\'s College of Engineering and Technology ', 'Mumbai', 'Other', 'IoT based Smart Farming', 'The project is more like a crop monitoring. I have to take to big pots and in one pot sow the crop(Capsicum and Tomato) using IOT and in another pot sow the same crop but without IOT and compare them. I have to design  a PCB from the circuit and monitor the crop. The  PCB includes different sensors like soil moisture sensor, DHT11, UV sensor an LCD display, water pump, rain sensor two relays one controlled with mobile/laptop and other controlled with switch on PCB and all controlled by a wifi module(Esp 8266).', 'Major Project', '[\"Other\"]', 'Bachelors', '[\"Electrical and Electronics Engineering (EEE)\"]', '2023-02-28', '15:00', '2023-01-20 08:13:27', 'NULL', '_$_', '11', NULL, 1, 1, 0, 0, 0, 0, 1, 0, 0, 0);
