INSERT INTO `contentwriter` (`id`, `firstname`, `lastname`, `mobile`, `email`, `address`, `genere`, `lang1`, `lang2`, `college`, `samples`) VALUES
(3, 'Khushi', 'Jasani', 8689912659, 'jasani.khushi06@gmail.com', '301,Shree Sai Krupa bldg, Hingwala Lane, Ghatkopar East, Mumbai - 400077', 'Creative Writing, Content writing ', 'English ', 'English ', '', 'Here I stay in this crowd of millions, a tiny girl with huge dreams.Living with many dreams in those beautiful eyes. Still a kid by heart. With a soft heart in this cruel world, I survive. With few hopes in this broken heart, I live. I wander in search of someone to help fulfil my bucket list with me. Wishing to gaze at those shining stars is what I want. Wishing someone to take me to the beach and walk besides me, along the silence is my kinda paradise. I am a girl willing to fight all those fears caged in my heart with all that pain I carry inside, with all those tears I wasted and all those hurts that I have beared. I have died a thousand deaths, but lived anyway. I still have regret in my heart for all the mistakes I\'ve made. Life pushed me down. But I am a girl who will never forget to rise again. Trying to become what I strike to be, I\'ll soar. Faking a smile and walking through roads, I\'ll shine. A girl who won\'t give up in this stubborn world,  a girl who won\'t give up on life. I\'ll stay this girl, forever.\r\n\r\n'),
(4, 'Mansi', 'Gada', 7977268951, 'mansigada85@gmail.com', 'Tilak road, ghatkopar east.', 'Lifestyle and fashion', 'English', 'Hindi', '', '\"Shakespere by heart,  Newton by mind\"\r\n\r\nToday lot of pragmatics are in a argument whether money is linked to happiness? Money = happiness?  \r\nWell, for a person like me.\r\nIf there\'s one thing I have learnt in life, it is probably to do what you love. Do what makes you happy as a carrer.\r\nPeople tell me, it\'s not easy to make your passion your job. \r\nI wonder. Every morning ,Monday to Friday 9-5 work and sitting there punching away the hours stressing about the work at hand \r\nIs that what makes you happy? Working and still feeling miserable about the life? \r\n\r\n\" I think the person who takes a job in order to live -  say for the money sake, has turned himself into a slave \". \r\n\r\nAnd, I don\'t think anyone deserves that.\r\n\r\nBeing an engineer or a doctor is not the only thing you have to choose. Be a musician, a dancer, an animator, YouTuber, VJ, anything and anyone that makes you proud to be.\r\n\r\n Decide between luxury and passion. Think what do you want out of life?\r\n What do you see when you close your eyes and imagine yourself in 5 years, the way your heart wants things to be like? \r\n\r\nIf you see a career that flows so perfectly with your passion that the border between \'work\' and \'fun\' doesn\'t even exist. Then my friend, chase your dreams.\r\n Find a passion that matches your talent and run with it. \r\n\r\n\" Chase your PASSIONS and money will come. Chase MONEY and you may never find your passion \". \r\n\r\nWhat about money? That\'s not running anywhere. Your efforts will pay you off any which ways. Money is a Medium of happiness. It\'s not the long lasting one. Your needs might be satisfied but then what about your heart? What does it wants? \r\n \r\nWell, Even a scientist can be a writer, even a dancer can be a doctor. Just do what you love and love what you do. Believe in yourself for once. Trust your talents and passion. You may fall, but rise up higher than before. \r\n\r\n\" Money is the purpose. The reason of your journey. But passion is the fire that lights your way. \"'),
(5, 'Neda', 'Sayed', 9167386704, 'sayednedaakhtar2@gmail.com', 'Kamlabai Sadan D\'monte street Hill road Bandra West', 'Technology, Food, Travel, automobiles, poems, comedy/ humor', 'English', 'Hindi', '', 'The word technology means different things to different people. But when I hear Androids and Gynoids, I hear technology, not as an end user but as an innovator and/or someone willing to learn and then take things to a different level. \r\nWhen I hear Artificial Intelligence (AI) or Virtual Reality (VR), the passion reaches another level. AI, for instance, has fascinated me since it arrived as a fact of life.\r\n--------------\r\nWhen it comes to technology,\r\nbeauty lies in the detail!\r\n\r\nTechnological advancements have made it possible and even encouraged people to connect with fellow humans in all parts of the world. They have also helped in resolving some of our greatest challenges faced by mankind.\r\n\r\nSome of the challenges are faced within the four walls of an organization on a regular basis. Adding the different dimensions to human communication has been a work in progress, and it seems to be entering a new era.\r\n\r\nThe Oblongâ€™s Mezzanine is a case in point. An interactive visual collaboration, which supports multi-users, multi-devices, multi-screens at multiple locations, OM could benefit users in many ways.\r\n\r\nIn other words, it seeks to reprogram and enhance the way colleagues work, both within the meeting rooms as well as chipping in from different parts of the world. OM ensures convenience is the name of the game for more teams in more workstations.\r\n\r\nItâ€™s unique features, such as its multi-image option, can be very useful across multiple platforms. Highlighting just one dimension of its various features indicates the possibilities that exist within its realm.\r\n\r\nPicture this - collaborative meetings can become even more smooth as it could refer to any PowerPoint, any database, and encompass various applications, all at the same time.\r\n\r\nIts multi-screening feature has the capacity to make the workplace more captivating, and the work environment more interactive and innovative. It opens a plethora of possibilities that few had imagined years ago.\r\n\r\nThe coming together of multiple people from different sources not only builds interactivity, it also makes content look more attractive.\r\n\r\nThe beauty lies in the detail though. Multi-streaming supports up to 10 streaming devices per room at once. This makes the discussions easy and brings topics and designs together as multiple streams of presentations can be shared at the same time using this device.\r\n\r\nMezzanine also ensures efficient ways of sharing, collaborating and contributing during seminars and meetings. All this has a tremendous effect on improving the productivity of the team.\r\n\r\nSo Mezzanine provides the user with dynamic features making the workplace more productive and innovative. The end result is a visually-immersive meeting and an interactive environment for the employees.\r\n\r\nLooked holistically, the features contained in Mezzanine go a long way in accommodating the different ideas and enhancing their presentation. Itâ€™s this attention to detail that brings focus on the big picture within any organization. \r\n\r\nHow to be more creative with your presentation?\r\n\r\nMezzanine provides with creative teamwork, meetings, and sales presentations. It also combines application sharing, designing and video \r\nconferencing, all within a framework of multi-participant control.\r\n\r\n     Users and team members can share content and information from laptops or mobile devices.\r\n\r\n-     EFFICIENCY in work?\r\n\r\nMezzanine enhances decision making, as it gives the customer or the user clear idea of all possible product and design specifications. Every participant of the team can share their ideas, live content and active participation in decision making. Elevates Customer Experience with large-screen environments.\r\n\r\n      Higher- impact on services, as it helps multiple team members share and compare data to make informed decisions. It is one stop for making meetings, presentation and communications, working sessions more advance and intelligent. Mezzanine go a long way in accommodating the different ideas and enhancing their presentation. Itâ€™s this attention to detail that brings focus on the big picture within any organization. \r\n\r\n- Neda Sayed\r\n\r\n-----------------\r\nPython 3 may be a new choice but Python 2 remains a legacy!\r\n\r\nPython is generally viewed as an interpreted, object-oriented, high-level programming language with dynamic semantics. Most programmers deal with Python as sophisticated and as more productive than other programming languages. \r\n\r\nPython-2 was officially released on February 20, 1991, developed by Guido Van Rossum. It became one of the most broadly implemented programming languages in the world and  made code development process easier than its earlier avatars. It executeded specialized  technical details of Python Enhancement Proposal (PEP).\r\n\r\nPython 2 vs Python 3\r\n\r\nSunset of Python-2 means the developers will no longer improve it even if someone finds a security problem in it. They must upgrade to Python-3 at the earliest. \r\n\r\nThe purpose of switching to Python-3 was to help to compose a framework that sets variables or characteristics to the â€œtypeâ€ property. This is significant considering Python-2 is an untyped language, which obstructs making of new codes. Python-3 improves the simplicity of composing and getting code, just as the exhibition of the code\'s runtime. Python-3 has clear, existing commands previously built into the code, making it very easy to use. For instance, in Syntax print â€œlineâ€ in Python-2 becomes print (â€œlineâ€) in Python 3, it changes print from a statement to a function. \r\nSignificant service of Python- 3 was released in 2008 to beat the blemishes and issues in Python-2.\r\n\r\nClosure\r\n\r\nPython-2 has already been  phased out, as Python-3\'s  adoption is the clear direction of the future: its the new choice! \r\nPython-3 supports more features, good compatibility and is dominant over Python-2. So it is better to prefer Python-3 for your programming profession and software development.\r\n'),
