(11, 'Shaariq', 'D', 9004427540, 'shaariqdude@gmail.com', '----', 'Economics', 'English', 'English', '', 'Book review of â€œThe Confessions of and Economic Hitmanâ€ â€“ John Perkins\r\n\r\nJohn Perkins was once upon a time a self-anointed â€œeconomic hit manâ€ (EHM) whose primary role was to infiltrate developing nations with large sums of money to bribe and loan out to big leaders, which would then be extracted for concessions to USA business interests. His book made it to the â€œNew York Times Best Seller Listâ€ and has been termed as an eye-opening expose of USAâ€™s role in the developing world.\r\n\r\nThe book â€œThe Confessions of an Economic Hitmanâ€ begins with Perkinâ€™s account of recruitment by the US National Security Agency (NSA) and his initial placement in Ecuador to learn more about his job. His first hit entailed working for a private international consulting firm (MAIN) and fudging numbers in order to show great economic growth in the next 20-25 years through the building of a hydroelectric dam, and similar infrastructure projects. These numbers were going to be sent to the World Bank who would then decide if they should give out a loan to Ecuador for the same. He was trained to project such numbers so that the loan money given would be funneled to US corporations such as Bechtel, Halliburton, Stone & Webster, among others that would in-turn help USA. This was his training project under his handler, who ensured he was ready to be sent out on his own.\r\n\r\nHis first individual project consisted of forecasting 25 year electricity demand for Indonesia. His job was to overestimate these numbers in such a way that it served their â€œmaster planâ€ of getting the oil industry among others, what they wanted. He overestimated the numbers successfully, the Indonesian government, Asian Development Bank, and other organisations, all lent out money that went on to help US corporations.\r\n\r\nIn the next chapters of the book, Perkins gives us a different point of view to major events that helped establish US hegemony through the acts of EHMâ€™s like him. The job usually entailed bribes and giving IMF advice or a nudge on matters that would end up benefitting the USA, but if they werenâ€™t enough, then â€œjackalsâ€ were called to complete the â€œhitsâ€. Some matters of public record such as CIAâ€™s coup against Mossadegh in Iran, assassination of Panamaâ€™s president Omar Torrijos, Saudi money-laundering affair, among other major events, were all the acts of the â€œjackalsâ€ among the hitmen, when peaceful ways didnâ€™t work.\r\n\r\nThe author thought about the dealings and intensity of the EHMs as like the Mafia, in which their employment titles and beguiling resumes are as scrappy as the authenticity of the financial arrangements made with the other nation. For example, Columbia was taken a gander at by the United States as a vital region to advance political and business interests. Huge investments in electrical power grids, highways, and telecommunications would open up Columbia\'s gas and oil assets. The authors job was, indeed, to go to Columbia, present an argument for accepting an exceedingly huge loan for inflated electric and economic forecasts under the appearance of development. Similar to the mob, EHMs are offered a lot of money for a straightforward jobâ€” for instance, making a phony financial arrangement expressing that for the following 25 years, a nation would see a 17â€“20% expansion in economic growth. What nation can deny the estimates of a specialised economist and conceivably miss such an amazing arrangement?\r\n\r\nIn spite of the fact that the author put forth a bold attempt to become companions with numerous local people in the nations he goes to, including bearing a puppet show in Indonesia that ridiculed the U.S. president and the work he himself was doing in the nation, he was ridden with blame. He portrayed himself in the book as an individual genuinely attempting to comprehend the nations\' point of view of conditions, political changes that occurred en route, and their definitive dread of death brought about by their monetary and political choices. Throughout the book his progressive deceit is described as standard working procedure in the most elevated echelons and his internal moral conflict due to his activities, the reader is left to think it is simply a question of time before Perkins himself will be simply the objective of a â€œjackalâ€ for distributing this data in book form. In spite of the fact that the author kept on filling in as an EHM for well more than 10 years, he did at last come to the realisation to follow his merciful heart to support the nations and companions he had made en route. His passion for those he once wronged for money and the globetrotting way of life. He zeroed in on applying his efforts in endeavours for everyone\'s benefit, for a superior world, which didn\'t include MAIN, the U.S. government, or some other EHM counselling firm, but instead included talking at global gatherings to teach future pioneers about the environmental and social costs influencing their nations and how to unravel them through green endeavours and recovering agribusiness.\r\nWith vivid representation of debt traps for developing countries, and the environmental impact of exploitation of Oil in Ecuador and Indonesia, it appeals to the eyes of development and international economics students. He also highlights the misleading picture of GNP as a measure of economic progress, and criticises the â€œtrickle-down economicsâ€ theory. He puts it as, helping economies grow to only allow the few people at the top of the pyramid become richer while those at the bottom continue to suffer, only pushes them lower. Capitalism here results in an inequal society like that of the medieval era.\r\n\r\nBeing a student of Economics, I couldnâ€™t put the book down, and the spy-thriller style really appealed to me. It made me more aware about the involvement of US in the global economy. Perkins also uses the terms â€œempireâ€ and â€œcorporatocracyâ€ to define Americaâ€™s approach, but in his epilogue he does provide guidance to move from this structure. He says, in order to stop this corporatocracy, we should reduce our oil consumption, and shopping expedition, and join in the seldom protests. This statement, wins the hearts of those who support capitalism as well, the ones who focus on the benefits, but acknowledge the costs too. He is not against capitalism per say, he is against the idea of exploiting the poor and weak to give back only to the ones at the top of the pyramid.\r\n\r\nAll in all, the book was the right mixture of first-hand experience and geopolitical conspiracy, that was quite appealing, easy to read and a good introduction to the world financial order.\r\n'),
(12, 'Pranav', 'Parikh', 8097040416, 'pspsnap50@yahoo.in', 'D/5, Apeksha Pujan Society Plot No-29 Gorai 1 Borivali West Mumbai 400091', 'Law', 'English', 'English', '', 'Need for Insolvency and Bankruptcy Code, 2016?\r\nSince India gained Independence there was not even a single law in our country which could specifically deal with insolvency and bankruptcy code. There were several laws in place which dealt with insolvency and bankruptcy for companies such as Sick Industrial Companies (Special Provision) Act, 1985, The Recovery of Debts Due to Banks and Financial Institutions Act, 1993, The Securitisation and Reconstruction of Financial Assets and Enforcement of Security Interest Act, 2002 and Companies Act, 2013 which could not be administered effectively and efficaciously. The Central Government of India proposed a legislation titled as â€œThe Insolvency and Bankruptcy Code, 2015â€ which had an effective and adequate framework which specifically and effectively dealt with insolvency and bankruptcy. This legislation was introduced by Ministry of Finance in Lok Sabha on 21/12/2015, which was referred to Parliamentary Joint Committee for its recommendation. It was later approved by both the Houses and received Presidents assent and it was known as â€œThe Insolvency and Bankruptcy Code, 2016â€ .\r\n'),
