(55, 11, 'INDIAN SOCIETY: CULTURAL DIVERSITY, HIERARCHIAL CHALLENGES AND INEQUALITIES', '800-1200 words', 'BROAD AREAS \r\n1. Gender aspect in religious rituals, regional traditions, folk songs, idioms, folk stories, mythology etc \r\n2. Any one Dalit poet/tribal poet in India\r\n3. Any one incident of atrocities against Dalit in post Independent India \r\n4. Any one caste based movement, reservation issues\r\n5. Any one Ethnic conflict in India \r\n6. Any one communal riot in post independent India \r\n\r\nWritten Assignment:                                                             10 Marks \r\n1)	15 pages\r\n2)	Font size:12 TIMES NEW ROMAN \r\n3)	TITLE IN CAPITAL and BOLD, SUB HEADINGS BOLD \r\n4)	Margins (normal),1.5-line spacing\r\n5)	Keywords in bold\r\n6)	Justified alignment\r\n7)	Front page:\r\nTitle\r\nClass- SYBA (Sociology)\r\nPaper- name and number \r\nGroup members- name and roll number \r\nEach section divided amongst members should have their names and roll numbers\r\nMain sub- sections- title page, acknowledgement, index, Introduction, review of literature, Methodology, analysis, conclusion, bibliography and Annexure  \r\n	\r\n Bibliography (APA 6th edition)-\r\nIn the text (surname, year: page no.)\r\nIn the end â€“ BOOKS/ edited books \r\nSurname, Initial of first name, year. name of the book, place of publication: name of the publisher \r\nIn case if edited book - Surname, Initial of first name, year. name of the chapter, in main author (ed), name of the book (in Italics),  place of publication: name of the publisher \r\nFor eg Godderis, R. and Rossiter, K, 2013. â€˜If you have a soul, you will volunteer at onceâ€™: gendered expectations of duty to care during pandemicsâ€™, in Dingwall, R., Hoffman L. and Staniland, K, (ed) Pandemics and Emerging Infectious Diseases:  The Sociological Agenda, UK: Willey-Blackwell. \r\n\r\nFor article \r\nSurname, Initial of first name, year. Title of the article, name of the journal, volume number, page numbers \r\nFor eg. Wenham, C, Smith, J. and  Morgan, R. 2020. COVID-19: The Gendered Impacts of the Outbreak, The Lancet, Vol: 395 (10227), P846-848.\r\nIn case of web source \r\nFor. Eg. Womenâ€™s Empowerment Principal (WEPS), 2020, Covid-19 And Gender Equality a Call to Action for The Private Sector, https://www.weps.org/resource/covid-19-and-gender-equality-call-action-private-sector.\r\nAnnexure \r\nQuestionnaire if any\r\nPicture, cutting of a newspaper article\r\nPlagiarism report- mandatory (https://www.grammarly.com/plagiarism-checker)\r\n\r\nProject Submission: \r\nâ€¢	10th September, 2020 \r\nâ€¢	Submission in Word Format (.docx) \r\nâ€¢	Submission on Microsoft Teams.\r\n\r\nPresentation:                                                                                                            5 marks \r\n1)	Individual Presentation- everyone in the group will have to speak \r\n2)	PPT-not more than 7 slides \r\n3)	Time: 5-7 min. \r\n-PPT should not be more than 7 slides excluding your title slide and your thank you slide. Kindly write your details like name, roll no, etc on the title slide)\r\n             4)  11th September onwards \r\n', '2020-09-12 09:58:39', '2020-09-13', 650, 1, 1, 1, 1, ''),
