(60, 13, 'Consumer perception towards digital payment', '800-1200 words', 'Questionnaire on service quality of digital payment : question like\r\nName , age, education, profession.\r\nHypothesis testing, Frequency Analysis of Respondentâ€™s Perception.(brand loyalty, convenience, time saving, acceptance etc) \r\nwhich Payment mode are they using, \r\nsecurity, reliability, assurance, responsiveness, customer support, satisfaction, preference( cash or digital mode) , ease of use, attractive discount\r\n\r\nSecondary data - when digital payment started in India how it has evolved over period of time and what is the transaction value and volume comparison \r\n\r\nWhat is current Situation of digital payment in India due to Covid 19 and how many are using and how many are aware\r\n\r\n\r\nKeywords-Cashless Transactions Consumer Perception; Digital Payment; Digital Wallets\r\n\r\nAbstract \r\nIntroduction\r\nLiterature \r\nResearch problem \r\nData analysis and interpretation \r\nQuestionnaire \r\nFuture scope \r\nConclusion \r\nReference', '2020-11-15 08:42:47', '2020-09-29', 650, 1, 1, 1, 1, ''),
(62, 14, 'Emerging startup- co-working industry', '800-1200 words', 'Topic name- Emerging startup- Co-working industry\r\n\r\nEnd objective- whether is it helping the economy or a bad model\r\n\r\nFormat of the project:\r\nAbstract \r\nIntroduction\r\nLiterature \r\nResearch methodology\r\nData analysis and interpretation \r\nFuture scope \r\nConclusion \r\nReference/Biblography\r\n\r\nKeywords- co-working space, co-working startups, co-working industry, co-working in india\r\n\r\nSynopsis needs to be submitted by 28th September-\r\nSynopsis will be the summary of the whole project (what am I going to include in the project)  basis format shared before\r\n\r\nCustomer feedback will be one way of research methodology\r\nScenario analysis of WorkAmp spaces  (will be another one)\r\n\r\nAnd in the introduction part we shall brief about 2-3 co-working startups in which one of the will be WorkAmp spaces', '2020-11-26 09:21:28', '2020-09-30', 650, 1, 1, 1, 1, ''),
(66, 15, 'Graphic novel ', '800-1200 words', 'Graphic novel ( Sita\'s Ramyana by Samhita Arni)\r\nDATE - 4 OCTOBER 2020 \r\n\r\nInstructions\r\n\r\nA research paper analysing either three poems/ graphic novel/ memoir applying feminist literary criticism should be submitted.Â \r\n\r\nKey points:Â \r\n\r\n1500-2000 word limit excluding abstract\r\n\r\nMLA style sheet 8 format\r\n\r\nWord documentÂ \r\n\r\nabstract of 150 words\r\n\r\nSections of the paper: Hypothesis, Theoretical Framework, Analysis, Conclusion.Â \r\n\r\n\r\nTheoretical Framework \r\nChoose from the feminisms and write from that perspective \r\n-Liberal feminism\r\n-Marxist feminism\r\n-Pschoanalytical feminism\r\n-Radical feminism\r\n-Ecofeminism\r\n\r\nAbstract (100 words) \r\nSummary of hypothesis , theoretical framework and analysis \r\n\r\n\r\nHypothesis\r\n1 one or two sentences -state what is that you are asking of the text. Question you are going to ask and answers you are going to seek \r\nExample \r\n\r\n\"A study of the character of Jane Eyre from the Marxist Feminism perspective to understand her position in the Romantic Age British Society and her relationship based on economic position with Rochester\" ( from the novel Jane Eyre - by Charlotte BrontÃ«)\r\nStay focused \r\n\r\nTheoretical Framework \r\nEssential narrow down question\r\nScope of study : what is that you are not covering in this essay \r\n\r\n1) which theory you are applying ?\r\n2) Theories or essays you are using and the summary of it .\r\n\r\nLiterature Review \r\n1)Listing the essays that already been written about the text \r\n2 Summary - one line or two lines about the particular essay \r\n\r\nAnalysis\r\nArguments - show the theoretical perspective \r\nUse examples from the text to give grounds to your arguments \r\n\r\nConclusion \r\nRight or wrong \r\nFind the answer or you have been proven wrong?\r\n\r\nRelevance of Research \r\n\r\nMLA style sheet 8\r\n1.5 spacing \r\nTimes New Roman 12\r\nLeft indent \r\nSingle or double quotes - maintain consistency \r\nUse the format mentioned for quotation and references \r\nReference to be done \r\n\r\nAttribution to be done thoroughly \r\nPlagiarism report ( Turnitin)', '2020-09-30 07:38:28', '2020-10-03', 650, 1, 1, 1, 1, ''),
(66, 16, 'Spanish Tragedy', '800-1200 words', 'The Spanish Tragedy \r\nDATE - 01 OCTOBER 2020\r\n\r\nChoose a scene from the play The Spanish Tragedy . Produce an interpretation using one or more of the approaches we have covered in the course: biographical, historical, and present-oriented. Tell us why you chose the approach (or approaches) you did. Reflect on what your interpretation brings out in the scene, and on the process you went through to arrive at that interpretation. Finally, answer the following question: if other approaches/interpretations are possible, why does the one you\'ve come up with matter? Your response should be in approximately1200 words.\r\n\r\n\r\nBiological, historical or political, contemporary \r\nEither analyze from 1 or all 3\r\nIf all 3 write 1 paragraph for all with proper explanation\r\nAlso from where you\'ve found out the info - citation\r\n\r\n\r\n1st para - intro (4-5 sentences)\r\nThe last statement of the 1st para should be thesis statement - I\'ve chosen this particular act / scene from .... because I think this reflects (whatever is your take and combination)\r\nLast statement - thesis statement\r\n\r\n1st para of argument - you take can words and how they justify your thesis statement. (1way)\r\n\r\nYou can show the relevance of today and of that time\r\n\r\nLast para - conclusion\r\n\r\nFont 12, Times New Roman 1.5 space \r\nReference to be done like a normal research paper \r\n\r\n', '2020-09-30 07:38:38', '2020-10-01', 650, 1, 1, 1, 1, ''),
