(68, 18, 'Study of Stress among Experienced Student\'s and Fresher Students in a Post Graduate Program', '800-1200 words', 'Objectives:\r\nThe Objective is to study socio-demographic factors among Working Professionals and Freshers in a Post Graduate Program\r\nThe Objective is to study academic factors among Working Professionals and Freshers in a Post Graduate Program\r\n\r\nStatistical Tools:\r\nChi-Square Test\r\nBinary Logistic Regression\r\n\r\nDetails Continued:\r\nKeep the Heading sizes 16, sub-headings 14 and font size 12 and font would be Times New Roman\r\nFor Data Collection we will need around 150 to 200 responses ', '2020-09-21 18:58:58', '2020-09-24', 650, 1, 1, 1, 1, ''),
(66, 24, 'Frankenstein - Mary Shelley', '800-1200 words', 'FRANKENSTEIN - BY MARY SHELLY\r\nDATE - OCTOBER 4 \r\nYou have to write a research paper seeing it as a gothic novel \r\nOnly focus on gothic elements \r\nIt will have \r\nAbstract \r\nMain research( seeing as a gothic novel using examples from text ) \r\nHypothesis (That you will be detailing Frankenstein as a gothic novel)\r\nAnalysis ( my pov , proving it a gothic novel)\r\nConclusion (concluding my research)\r\n\r\nThe main research and analysis will be mingle up cause Mary shelley\'s way of portraying the setting sets the novel as a gothic piece.\r\n\r\nReferencing \r\nPlagiarism report\r\nPattern is same like graphic novel ( font size , type , colour and entire pattern MLA ) \r\nWord limit - 1500-2000\r\n\r\nDeepika Vegad \r\nPaper 7 \r\nThe Romantic Revival - paper name \r\nShweta Salian - professor', '2020-09-30 07:37:22', '2020-10-04', 650, 1, 1, 1, 1, ''),
