(74, 27, 'Economic growth of our economy during the Covid 19 2020', '800-1200 words', 'Students are required to mention the references/bibliography at the end of the project work\r\nContent if copied will be rejected\r\nProjects to be submitted in electronic format in the above mentioned email\r\nThe number of PPT slides must be minimum of 18 slides (charts, pie charts, graphs, news paper cuttings in English can be used)\r\nThe font size is â€˜New Times Romanâ€™ 12â€ \r\nWord file submission to follow â€˜New Times Romanâ€™ 12â€, 1.15 spacing (charts, pie charts, graphs, newspaper cuttings in English can be used)\r\nIn PPT the colour scheme has to neat with visible font size\r\nPoster presentation â€“ you can submit in CorelDRAW format eg a small booklet with four sides. You have to explain the state of the economy/topic with analysis (you may borrow the idea but interpretation and analysis has to be original)\r\nYou need to mention the source of every reference made by you \r\n Make a neat and clean presentation and submission\r\n\r\n', '2020-10-19 18:17:32', '2020-10-18', 650, 1, 1, 1, 1, ''),
(66, 28, '20th Century British Literature', '800-1200 words', 'Write a literary analysis on the 20th century British play - Look back in anger -by John Osborne \r\nLook at it from the historical context \r\n\r\ndeal with the historical context and the people of that era. \r\n\r\nThe emotions being governed by other. Its a post war play\r\n\r\nUnderstand the history,  connect it with socio political pov \r\n\r\nUse papers for reference but say something new , not the already existing, something different from others , your own original work .\r\n\r\nMinimum words 1700 \r\n\r\nMLA sheet style \r\nFormat ( font and all remain same )\r\n\r\nIntro\r\nMain body \r\nConclusion \r\n Referencing to be done properly\r\n\r\n\r\n', '2020-10-15 18:10:00', '2020-10-14', 650, 1, 1, 1, 1, ''),
