(95, 31, 'Mini project on Restaurant management system using java', '800-1200 words', '\r\n\"Online Restaurant Management System\" is a web application. This restaurant management system can be used by employees in a restaurant to handle the clients, their orders and can help them easily find free tables or place orders. The restaurant menu is organized by categories (appetizers, soups, salads, entrees, sides and drinks) of menu items. To resister a meal online, the customer has to become a member first then he can access the later part of the site. this project to facilitate customer for make online ordering and reservation. The option of becoming member was only an attempt to avoid (to some extent) placing the fake bookings. After successful login the customer can access the menu page with the items listed according to the desired time. The main point of developing this system is to help restaurant administrator manage the restaurant business and help customer for online ordering and reserve table.Â \r\n', '2020-11-14 19:03:37', '2020-11-15', 650, 1, 1, 1, 1, ''),
