(112, 45, 'Restaurant Management System', '800-1200 words', 'Objective:\r\n\r\nIn our current situation we face many problems like misunderstanding while we order food from customer\'s point of view). Doubt on waiters (from management\'s point of view).\r\n\r\nTo revoke this type of problems we need such software. It is very logical to handle above problems. This system will not a complex. Tt\'s very simple and easy to maintain.\r\n\r\nADVANTAGES:\r\n\r\n> Easy to use.\r\n\r\nâ€¢ Easy to learn the system.\r\n\r\n> Easy to order food.\r\n\r\n> Easy to select which food have to prepare.\r\n\r\nEasy to calculate bill.\r\n\r\nPROJECT ANALYSIS:\r\n\r\nAccording to our project goal we have to do following things...\r\n\r\n1 User login option.\r\n\r\n2 Table No, food items. Price, food selection and order options.\r\n\r\n3. Oder flow to kitchen room and cash counter.\r\n\r\n4 Order receving acknowledgement\r\n\r\n5. Bill receving system.\r\n\r\nHardware:- 512mb ram\r\nintel i3 processor\r\n4gb ram \r\n', '2020-12-15 09:10:38', '2020-11-26', 650, 1, 1, 1, 1, ''),
