(133, 50, 'Letter for persuading members of team to perform CSR', '400 words', 'You are the Manager of the Corporate Communication Department of a multinational firm in Mumbai. Every year, as part of its Corporate Social Responsibility (CSR) initiatives, the employees of your organisation are to dedicate three working days to assist the activities of a local NGO for underprivileged children. This year, you have been asked to spearhead this activity scheduled for the second week of December. Write a letter persuading the employees to participate in this activity, convincing them of its importance while attempting to overcome their likely objections. (Use the Full Block or Modified Block layout)\r\n', '2020-11-27 21:03:04', '2020-11-30', 300, 1, 1, 1, 1, ''),
(138, 51, 'Hospitality management report', '800-1200 words', 'Total 2500 - words\r\n250 words - introduction\r\n2000 words - main body \r\n250 words - conclusion\r\n\r\nMain Body Flow:-(2000words)\r\n200-250 words(approx) Overview \r\n(define resorts,views of some people on resorts, types of resorts, comparison,history)\r\n\r\n300 words - lucrative industry(profit and help towards the rural people) & Critical View(Challenges faced by resorts [5-6 challenges]) related to the Servqual just  overview no examples needed here\r\n\r\n1500 Words - \r\nsearch for challenges faced by resorts in real life relating to Servqual Gap (needs a specific name of the property no overall allowed) and discuss each for 500 words * 3 = 1500 words {ONLY RESORTS for example}\r\n\r\nflow for each 500 words (Same has to be done thrice different theory, different example flow remains the same)\r\n1. Explain and discuss a challenge faced by resorts then give a example by giving name of the property which dealed with the same challenge discussed explain it exactly what happened in the property(challenge discussed should be related to the servqual)\r\n2. Explain the Servqual Gap theory which relates to challenge explained\r\n3. Explain how they got the solution and if there\'s no solution in the data suggest the solution\r\n\r\n\r\n* Any Research data older than 2010 not allowed', '2020-12-15 09:12:08', '2020-12-11', 650, 1, 1, 1, 1, ''),
