(166, 60, 'International Economic Law- Situation-Solution ', '800-1200 words', 'Hi, it is a Situation-solving assignment under international economic law subject. \r\nWord Limit: 1500 words with 15% margin \r\nFormat: Question-Answer type. Just heading page numbers and case laws or examples would be fine. \r\nDeadline: 05-02-2021.\r\nSituation: The countries Tukoshi and Bukoshi are members of the WTO. Taking note of the fact that the appellate panel is not functioning presently, they have decided to enter into â€˜No Appeal Agreementâ€™ and undertaken to bind themselves to the panel determination. In December 2020, Tukoshi has taken trade-restrictive measures that have affected the markets of Bukoshi. Getting aggrieved, Bukoshi has requested for consultation with Tukkoshi however, the request was rejected. On such rejection, Bukoshi has approached DSB with a written request and â€˜term of referenceâ€™ for the appointment of a panel. Without wasting time, the DSB has constituted a panel of three members and the matter was heard. Both parties were not happy with the panel determination and wanted to have another judicial mind be applied to this dispute. In this scenario, the following question is to be determined in the light of Understanding on Rules and Procedures governing the Settlement of Disputes, 1994.  \r\n1. What options Tukoshi and Bukoshi are left with in the light of the â€˜No Appeal Agreementâ€™ to resolve their dispute?\r\nThe present agreement between Tukoshi and Bukoshi is based on the patterns of the agreement entered into by the world leaders.\r\n\r\n ', '2021-03-28 08:41:54', '2021-02-05', 650, 1, 1, 1, 1, ''),
