(99, 785, 1022, 'TY BLS LLB Internal Assignments', 'Habib Educational and Welfare Society\'s\r\nM.S. COLLEGE OF LAW\r\n(Affiliated to University of Mumbai & Recognized by Bar Council of India)\r\nNAAC Accredited\r\nHabib Educational Complex, M.H. Mohani Road, Kausa, Mumbra, Dist. Thane-400 612, Maharashtra\r\n\r\nDate 22nd August 2022\r\n\r\nTY BLS - LLB (SEM-V)\r\nLEGAL LANGUAGE, LEGAL WRITING AND GENERAL ENGLISH\r\nINTERNAL EXAMINATION ASSIGNMENT AND CASE STUDY\r\nA.Y 2022-2023\r\n\r\nPART I â€“ ASSIGNMENT (10 Marks) Attempt all\r\n1.	Damnum Sine Injuria.\r\n2.	Audi alteram partem.\r\n3.	Salus populi est suprema lex.\r\n4.	Caveat emptor.\r\n5.	Actio personalis moritur cum persona.\r\n\r\nNote: \r\nWrite All 5 questions given above on an Assignment paper, one side blank and one side ruled. \r\nWrite full Assignment (Questions and Case law) with a Blue Pen.\r\nEach question should be of Minimum 10 to 12 sides of the page. For 5 questions minimum 50 to 60 sides which actually is  50 to 60 pages since one side is Blank that is without lines.\r\nDraw a half inch margin on right side of the page.\r\nWrite Student Name, Roll no, Class on the top right hand side of the Page.\r\nNumber each page in the centre bottom of the page in Black Pen.\r\nMake Cover page as per photo sent.\r\nMake Index as per the photo sent.\r\nWrite both Case law from the below given.\r\nCase Law should be written in below given manner\r\nFact of the case â€“ minimum 1 side of the page.\r\nIssues: minimum 2 pages.\r\nArguments â€“ 3 pages.\r\nDecision â€“ minimum 1 page.\r\nSubmission date : 20th September 2022.\r\n\r\nPART II.  CASE STUDY (10 marks)\r\n\r\nCase study must include facts, issues, arguments and decision\r\n\r\n1. M.C. Mehta V/s Union of India AIR 1987 SC 965\r\n2. Vishaka & ors V/s State of Rajasthan & ors AIR 1997 SC 3011.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nM. S. COLLEGE OF LAW\r\nAffiliated to University of Mumbai and Recognized by Bar Council of India\r\nNAAC accredited\r\nHabib Educational Complex, M H Mohani Road, Kausa, Mumbra, Dist. Thane, 400 612, Maharashtra\r\n\r\nIMPORTANT NOTICE\r\n(A2022-23)\r\n\r\nPRACTICAL TRAINING I ASSIGNMENT\r\nB.LS (V Semester)\r\nThis is to hereby inform all the students of the B.LS (V Semester) regarding Practical Training I examination.\r\n1.	The practical training examination will be conducted for the students and the students will have to submit the Assignment in Spiral binding.\r\n\r\n2.	 The front page shall contain the name of the student, roll number and class. The subject of the front page should be PRACTICAL TRAINING I.\r\n\r\n3.	 The last date of submission of the memorial is 07th Sep 2022.\r\n\r\n4.	Write full Assignment with a Blue Pen.\r\n\r\n5.	For each topic students have to write 10 pages. All the topics given below are compulsory. For 5 topics, minimum 50 sides which actually is 50 pages since one side is Blank that is without lines.\r\n\r\n6.	Draw a half inch margin on right side of the page.\r\n\r\n7.	Number each page in the centre bottom of the page in Black Pen.\r\n\r\n8.	Make an Index as per the photo sent.\r\n\r\n\r\n\r\n\r\nAssignment topics are as follows\r\n\r\n1. Contempt of Court.\r\n2. What are the Seven Lamps of Advocacy?\r\n3 Functions of Bar Council of India.\r\n 4. What constitutes \"Professional Misconduct\" in the legal profession? illustrate your answer in the light of decided cases. \r\n5. Salient features of the Advocates Act, 1961.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nWeHabib Educational and Welfare Society\'s\r\nM.S. COLLEGE OF LAW\r\n(Affiliated to University of Mumbai & Recognized by Bar Council of India)\r\nNAAC Accredited\r\nHabib Educational Complex, M.H. Mohani Road, Kausa, Mumbra, Dist. Thane-400 612, Maharashtra\r\n\r\nDate 22nd August 2022\r\n\r\nTY BLS - LLB (SEM-V)\r\nLABOUR LAW\r\n(INTERNALS)\r\nA.Y 2022-2023\r\n\r\nWRITTEN ASSIGNMENT    (10 MARKS)\r\n\r\nChoose Any 2 questions from the following\r\n\r\nQI) what is an industrial dispute under the Industrial Dispute Act, 1947. State the essential ingredients of the industrial dispute and also state when individual dispute can become industrial dispute?\r\nQ2) What is collective bargaining? State the object and scope of collective bargaining?\r\nQ3) What are the object, organ and effect of International Labour Organisation.\r\nQ4) What are various authorities under industrial dispute act.\r\nQ5) Summarize the provision of the Employees Compensation Act 1932 relating to appointment, powers and functions of the commissioner.\r\n\r\nNote: \r\nWrite any 2 from the above 5 questions on an Assignment paper, one side blank and one side ruled. \r\nWrite full Assignment (Questions and Case law) with a Blue Pen.\r\nEach question should be of Minimum 8 side of the page. For 2 questions minimum 16 side which actually is  16 pages since one side is Blank that is without lines.\r\nDraw a half inch margin on right side of the page.\r\nWrite Student Name, Roll no, Class on the top right hand side of the Page.\r\nNumber each page in the centre bottom of the page in Black Pen.\r\nMake an Index as per the photo sent.\r\nWrite any 2 Case law from the below given 3.\r\nCase Law should be written in below given manner\r\nFact of the case â€“ minimum 1 side of the page.\r\nLaw / Concept applicable â€“ minimum 3 page.\r\nJudgement â€“ minimum 1 page.\r\nSubmission date : 08 September 2022.\r\nII)  CASE LAWS\r\nChoose Any 2 Cases from the following (10 MARKS)\r\n1) Banglore Supply & Sewage Board V/S Rajappa AIR (1978 SC 548) \r\n2) Dharangadhara Chemical Work Ltd V/S State S Saurashtra 1957 AIR 264, 1957 SCR 152.\r\n3) Hospital Mazdoor Sabha V/S State of Bombay AIR1960 SC 610.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nHabib Educational and Welfare Society\'s\r\nM.S. COLLEGE OF LAW\r\n(Affiliated to University of Mumbai & Recognized by Bar Council of India)\r\nNAAC Accredited\r\nHabib Educational Complex, M.H. Mohani Road, Kausa, Mumbra, Dist. Thane-400 612, Maharashtra\r\n\r\nDate 22ndAugust 2022\r\n\r\nTY BLS-LLB (SEM-V)\r\nCONTRACT LAW-I\r\n(INTERNALS)\r\nA.Y 2022-2023\r\n\r\nWRITTEN ASSIGNMENT(10 MARKS)\r\nChoose Any 2 questions from the following â€“\r\n\r\nQ1) \"All agreements are not contract, but all contracts are agreements\". - Explain \r\nQ2) What are the different types of Void Agrements.\r\nQ3) What is breach of contract? What are remedies available in case of breach of contract?\r\nQ4) Explain principles of protection against the possibility of exploitation.\r\nQ5) Mention the constitutional provisions related to government contract. Explain Government power to contract, procedural requirements and kinds of government contract with their clauses.\r\nNote: \r\n1.	Write any 2 from the above 5 questions on an Assignment paper, one side blank and one side ruled. \r\n2.	Write full Assignment (Questions and Case law) with a Blue Pen.\r\n3.	Each question should be of Minimum 8 side of the page. For 2 questions minimum 16 side which actually is 16 pages since one side is Blank that is without lines.\r\n4.	Draw a half inch margin on right side of the page.\r\n5.	Number each page in the centre bottom of the page in Black Pen.\r\n6.	Make an Index as per the photo sent.\r\n7.	Write any 2 Case law from the below given 3.\r\n8.	Case Law should be written in below given manner:-\r\ni)	Fact of the case â€“ minimum 1 side of the page.\r\nii)	Law / Concept applicable â€“ minimum 3 page.\r\niii)	Judgement â€“ minimum 1 page.\r\n\r\nCASE LAWS (10 MARKS)\r\nChoose Any 2 Cases from the following\r\n\r\n1) Lalman Shukla vs. Gauri Dutt, 1913 40 ALJ 489 \r\n2) Mohoribibee V/s DharmodasGhose ILR (1903) 30 CAL 539 (PC).\r\n3) State of Bombay V/S R.M.D. Chamarbaugwala 1957 AIR 6599, 1957 SCR 874.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nLaw of Torts\r\n \r\n', 0, 'Law', '[\"Case Studies\",\"Question and Answer Based\"]', 'Bachelors', '[\"Tort Law,Labour law,Contract Law,Advocacy,Legal Language\"]', '2022-09-23', '07:30', '16/09/2022 06:09:39', '2022-09-16 07:28:26', 'Not given', 'TY BLS LLB Assignment 5 subjects.docx_$_', '', '', 1, 0, 0, 0, 0, 0, 0),
