(132, 1002, 1151, 'Launching New Ventures', 'Individual Report\r\n3, 000 words worth 75% of module mark.\r\n\r\n\r\nThere are two parts to the individual report:\r\n\r\nPart 1: Essay (70%) evaluating theoretical frameworks and concepts explaining the process of launching new ventures.  Your report should demonstrate wide reading and comprehension of the theoretical frameworks introduced in the module. You are expected to draw on key concepts and frameworks to analyse the process of launching new ventures. Good reports will draw on theoretical concepts to show understanding of the challenges typically encountered when creating a new venture. This may include frameworks explaining the influence of uncertainty and related knowledge problems on new ventures; strategies for creating new firms, the foundersâ€™ role, and how entrepreneurs can overcome challenges such as resource dependency and liabilities of newness/scale.\r\n\r\nPart 2: A Self-reflection (30%)  Written in the first person (I) this part of the report should demonstrate your personal understanding of the process of creating a new venture. You do not need to draw on theoretical frameworks in Part 2. Instead, you can draw on previous entrepreneurial experiences (e.g., founding your own firm, working for start-ups, entrepreneurial competitions (e.g., Ingenuity) internships, family business etc). It may also be helpful to draw on your experiences during this module. For example, what insights did you gain from designing a Business Model for a new venture? What might you do differently? Finally, you may project into the future to consider how you would approach the process of launching a new venture. Have you gained any insights from this module that you would use in the future if you were creating your own venture or joining a start-up?\r\n\r\nSome key points to consider:\r\n\r\n1)   The individual report requires two parts: Part 1 is a standard academic essay with references, introduction, discussion, and conclusion. Part 2 is a self-reflection written in the first person (I) and based on your personal understanding of the process of launching a new venture.\r\n\r\n2)   A marking rubric for the individual report is provided on Moodle.  Summarising from the rubric, a good report must demonstrate the following:\r\n\r\nUnderstanding of theoretical frameworks introduced during the module to explain the process of launching new ventures;\r\nA clear explanation of what business models are and why they are relevant for launching new ventures;\r\nEvidence of comprehension based on high quality and wide ranging referencing of literature included in the reading list;\r\nSelf-reflection showing personal understanding of the process of launching a new venture.\r\nWell structured, rigorous and logical report.\r\nWord count specified is to be strictly adhered to. A penalty will be applied if this is not adhered to.\r\n\r\nCoursework Submission Requirements:\r\n\r\nThe maximum word count (3, 000) is set by the module convenor and must be adhered to. The penalty for exceeding this limit is a five mark deduction.\r\n\r\nThe actual word count of the assignment must be stated by the student on the first page (cover sheet) of the assignment.\r\nThe overall word count does include citations and quotations.\r\nThe overall word count does not include the references at the end of the report.\r\nThe word count does not include figures and tables.\r\nAppendices may be included and are not included in the word count.\r\nStudents should prepare and submit their coursework assessments in the following format:\r\n\r\nFont:                       Verdana 12 point\r\nSpacing:                 1.5 spaced\r\nMargins:                 Normal (2.5 cm)\r\nReferencing:          Harvard citation style', 0, 'Launching New Ventures - Business ', '[\"Report Writing\"]', 'Masters', '[\"Launching-New-Venture\"]', '2023-01-02', '09:30', '15/12/2022 06:12:13', '2022-12-15 06:25:44', '3000 - 5000', 'Sample report - Launching New Ventures .pdf_$_BUSI4532 Launching New Ventures Individual Report v1.docx_$_', '', '', 1, 0, 0, 0, 0, 0, 0),
(133, 1026, 909, 'Case study analysis of (xyz) company', 'Guidelines for assignment 1:\r\nPick a company \r\n\r\nAnalyse it\'s vision and mission and statement of objectives\r\n\r\nCome up with a central theme of problem for the company\r\n\r\nAnalyse the problem with strategic concepts(use textbook and see what relates to your problem and use it)\r\n\r\nShow Challenges and alternatives for the company \r\n\r\nShow Emle about the solutions\r\n\r\nDo abstract for the same', 0, 'Hotel management', '[\"Case Studies\"]', 'Bachelors', '[\"APA format references\"]', '2022-12-29', '17:00', '26/12/2022 04:12:48', '2022-12-27 22:31:24', '3000', 'Assignment 1 - FAQ.pdf_$_', '', '', 1, 0, 0, 0, 0, 0, 0),
(134, 1020, 1164, 'Land Cover Classification of Satellite Imagery using Deep Learning', 'In the assessment of remotely sensed imagery, hyper-spectral (HSI) image classifications are commonly employed. The hyper-spectral image includes various image bands. The Convolutional Neural Network (CNN) is an extensively useful deep learning algorithm for data visualization and processing. Both the Spatial along with Spectral information are important for HSI classes to be effective. Due to the higher computing complexity, only a few approaches have used 3D CNN. Hybrid Spectral Convolutional 2D-3D Network (HybridSN) is instituted for HSI classing in this paper. HybridSN involves a spatial and spectral 3D-CNN which is then trailed by a spatial 2D. A study of more abstract level spatial representation will continue with 2D-CNN over 3D-CNN. Furthermore, when compared to conventional CNNs, the employment of hybrid CNNs lessens the modelâ€™s complexity. To see if this hybrid method works, a thorough HSI phase test was performed over Indian Pines, Salinas and Pavia University and results compared to ground truth. The presented HybridSN HSI classification model provides with best result.\r\nMapping the quilt of land and land use (LULC) using the long distance sensory records has been a task for a long time because of diverse capabilities and mixtures, especially in all exclusive city areas.LULC facts are extensively used in Geographic facts device (GIS) applications. Accordingly, correct, high-quality maps and precise statistics are wanted anywhere and whenever. Despite the fact that images and remote sensing techniques,in addition with subject exploration, have been key resources for figuring out the land use characteristics, the inner dimensions of neighbourhood statistics based totally information series for oneâ€™s capabilities have constantly been a hard step in terms of time, money, and so forth because of the reliability of the data.\r\nImage classification is a rapid method and the most commonly used one in areas of computer vision incorporated with Hyper-spectral Image Classification (HSI) for remote sensing image survey. The Convolutional Neural Networks (CNN) are one of the most broadly utilized deep learning-based computing algorithms. HSI is made up of different image bands. Convolutional neural networks (CNNs) have achieved great success in the field of image classification over the past few years because of their fast and very precise feature extraction skills and continuously qualified network frameworks. CNN architecture comprises a series of hidden layers, with input and an output layer. The dissimilarity is that whereas the result of the convolutional computation is an attribute of the picture, the source of the CNN is an image (pixel matrix).', 0, 'Computer Science, Image Processing', '[\"Report Writing\",\"Literature Review\",\"Blackbook\",\"Research Paper\",\"Programming / Coding Assignment\"]', 'Bachelors', '[\"Image Processing,Deep Learning Projects in Python\"]', '2022-12-25', '21:25', '25/12/2022 08:12:06', '2022-12-28 22:40:37', '0', 'Abstract.docx_$_', '', '', 1, 0, 0, 0, 0, 0, 0),
(135, 1021, 1164, 'Wine Quality Analysis Using Machine Learning', 'Quality Analysis or Test of Wine is done over here; to get the information about the quality as well as ingredients much related the wine. Nothing is better than wine analysis because wine is one the most likable products in the market which is consumed by over 60% of the population around the world. \r\nIn our project, Wine Analysis has been achieved by using the Machine Learning (ML). This method is been considered as it save a lot of time; one person can do the analysis as it is easy to use, once it is understood and not a million bunch of people is required to do so, all the required data can be acquired in the form of bar plot, which is needful for the organization and also in a data can be retrieved in a statistical form. Here, the analysis has been done by getting the dataset from the freely available website i.e. kaggle. Herein from Kaggle, various no. of datasets can be downloaded that too for free as it is an open source. Wine Analysis is been taken into consideration because a number of steps is been followed to make one wine and into a lot of procedures it goes through, that too takes years and years to taste it better. This happens as wine takes years to sweeten by taste. However, the ingredients used in that particular wine should also be as such it should not make wine bitter or poisonous. Analysis is the a must to be done for avoiding further such situations.\r\nAnalysis can be done by the requirements of the organization; it can be a bar-plot or a bar graph. It could also be an accuracy percentile (%) which is much easier to read and understand (out of 100%). Machine Learning is one of the most popular methods which have now growing as a field of analysis and data recognition. Data visualization and analysis helps the customers to understand what exact % of ingredients and certain alcohol is present or absent. This analysis and visualization gives a better understanding and prediction of the further procedures which could be held according to that criterion.\r\nIn summary, data visualization is a crucial step to improve the understanding by manual acceptance. Moreover, it makes the visualizations dynamic with any real-time analytics.\r\n', 0, 'Computer Science, Machine Learning, Python, Data Analysis', '[\"Primary / Secondary Data Analysis\",\"Programming / Coding Assignment\"]', 'Bachelors', '[\"Data Analysis in R/Python,Machine Learning\"]', '2022-12-26', '00:28', '25/12/2022 12:12:17', '2022-12-28 22:40:54', '0', 'Module8.docx_$_Module7.docx_$_Module6.docx_$_Module5.docx_$_Module4.docx_$_Module3.docx_$_Module2.docx_$_', '', '', 1, 0, 0, 0, 0, 0, 0),
