here I asked questions by circulating a Google Questionnaire. I gave English tuition to students (up to class XII) during the Lockdown. I taught them using PowerPoint presentations that I used to make a day before. I prepared my own lesson plans. That experience benefitted me a lot and would hopefully prove to be an add-on in the profession that I\'ll choose.', 'Zoha Akbar [updated profile] (1).pdf_$_', -1, '0', '0', 1, 0, 0, 0, NULL),
