(5, 'Prerna', 'Kotecha', 'prernakotecha292@gmail.com', 'Female', 'India (à¤­à¤¾à¤°à¤¤)', '7096724511', '7096724511', 'Bhavani krupa, raiya road, ', 'Bharti nagar-2', 'Rajkot', 'Gujarat', '360007', 'Usha pravin gandhi College of science, commerce and arts', '2022-02-05 10:13:55', 'Non - Technical', 'I would rate myself as 9.5 here\r\n9.5 because i take the assurance of the person i choose for the company and i have taken many interviews as a board of director in Rotaract club from even the freshers who have no knowledge or skills and choosing out the best from them is a task.\r\nI have rated 0.5 less because at times it may happen that the person chosen may not work that efficiently as before but it is still my responsibility to make that person convince to work as before and i won\'t backout for the same.', 'So basically yes i have been working in Rotaract club of my college and appointed as a board of director where in have taken more than 40-50 interviews in just 3 days that tooo from the freshers batch, it\'s like curving a diamond out of the stone and hence this has given me the most beautiful experience', '1) Experience of about 40-50 interviews in 3 days and still about to take more.\r\n2) communication which is the most powerful thing to talk to the freelancer and the employees both.\r\n3) responsibility and accountability of work done by the employees chosen by me.', 'IMG_20220205_223004_331.jpg_$_'),
