(9, 'Sana', 'Darji', 'sana.bhavin@gmail.com', 'Female', 'India (à¤­à¤¾à¤°à¤¤)', '9870891484', '9870891484', 'Mira Road East', 'Mumbai ', 'Mumbai ', 'Maharashtra', '400066', 'Marol Education ', '2022-10-21 07:23:12', 'Technical', '10 because sourcing and attracting a right candidate is required ', 'Yes I did hiring ', 'I can showcase my talent ', 'Sana B Darji - Senior HR Professional- 15th Oct 2022.pdf_$_'),
(10, 'abhilash', 'benny', 'abhilashbenny48@gmail.com', 'Male', 'India (', '6238960081', '6238960081', 'mumbai saki naka', 'ayappa mandir ,road', 'saki naka', 'mumbai', '400072', 'presidency university,bangalore', '2022-10-21 21:51:59', 'Non - Technical', 'As of now I would rate myself from scale 1 to 10 will be 7 as I do have experience in working in HR in tripod creation ,Goa but at the same time I believe that I have to learn a lot more .. \r\n\r\n Iam a dedicated person and moreover I try to learn new things daily so as to keep myself updated always ', 'As I mentioned earlier I worked in tripod creation ,Goa the company makes paper stars and export it to foreign countries like Germany ,so I do have experience in talking to clients understanding their needs and preference on basis of that particular is ,made and designed ..', 'I firmly believe that for the progression of our company and to learn and collaborate and to get best employees working in our company it is very much important to screen right candidates for our company ...as I did my BBA in HR specialisation and as of my work experience I firmly believe that my knowledge and idea can get best employees working for us ...', 'cv.pdf_$_'),
(11, 'Imran', 'Shaikh', 'imranshaikh199140@gmail.com', 'Male', 'India (à¤­à¤¾à¤°à¤¤)', '9867636086', '9867636086', 'Bhayander west', 'Thane', 'Thane', 'Maharashtra', '401106', 'Nirmal degree college', '2022-10-24 00:08:50', 'Non - Technical', 'Has 7+ years exp in end to end recruitment and generalist role', 'End to end recruitment, generalist role, bulk hiring. Salary negotiate, employees engagement', 'Have good quality of hiring skill & negotiations', 'Resume - Imran Shaikh HR.docx_$_'),
(12, 'Abhishek', 'Mishra', 'abhishekmishra8451@gmail.com', 'Male', 'India (à¤­à¤¾à¤°à¤¤)', '8451813876', '8451813876', 'Achole Rd.', 'Ambawadi, Kesari park.', 'Mumbai', 'Maharashtra', '401209', 'Theem College of Engineering', '2022-10-25 01:52:46', 'Technical', '8. Cause I\'m very much familiar with all the social media sites and job portals. ', 'NA. there wasn\'t any opportunity.', 'I\'m always up to date.', 'Resume.pdf_$_'),
(13, 'Tribarna', 'Mitra', 'tribarnamitra@gmail.com', 'Female', 'India (à¤­à¤¾à¤°à¤¤)', '8777870616', '8777870616', 'A204, Shelter Residency, Kharghar, Sector 10, Navi Mumbai', 'Sector - 10, Kharghar', 'Navi Mumbai', 'Maharashtra', '410210', 'Lady Brabourne College', '2022-10-26 00:33:25', 'Non - Technical', 'I am a very hard worker but yet not a 10/10 because I cannot say that I have never let my work slide at times. I am human, a work in progress, and not perfect. With that said, I know the importance of delivering exceptional work. Truthfully, nobody is 100% \'on\' all of the time. I will give myself a eight because I always do my best to be as eager and present as possible.\"\r\n\r\n', 'To begin, I have the educational qualifications, job skills and work experience necessary for this position. I have received appreciation in my  job for my performance, teamwork abilities. I will channel that experience here to select and implement the right methodologies to give my best for the company.\"', 'I consider myself to be a dedicated and dependable individual who possesses excellent verbal and written communication skills. This opportunity would also allow me to refine my skills in a new working environment.\r\nTo date I feel my strongest abilities are:  \r\nâ€¢	Talent Acquisition and the HR Operation activities.\r\nâ€¢	Developing targeted outreach recruitment programs to recruit the best talent and meet all \r\nâ€¢	departmental hiring requirements \r\nâ€¢	Managing End to End IT Recruitment for Clients that includes Sourcing, Screening, Interview \r\nscheduling & coordination, Feedback Collection and Post offer Follow-up.\r\nâ€¢	Onboarding and Managing resources in the organization.\r\nIn closing, I would like to thank you for your time and attention, and I hope to have the chance to discuss the opening with you in person. \r\n\r\n', 'Tribarna Mitra Resume - pdf.pdf_$_'),
(14, 'Shareef', 'Shaik', 'sks817073@gmail.com', 'Male', 'India (à¤­à¤¾à¤°à¤¤)', '8464974321', '8464974321', 'D.no.1-62 vanukuru village near vijayawada, andhra pradesh state', 'main road', 'Vijayawada', 'Andhrapradesh', '521151', 'Jntuk', '2022-10-26 04:30:59', 'Technical', 'i am a Techenical back ground person I also manage non-techenical also 9.7/10', 'I attended few bulk & talent aquasiation programs As per our company need.', 'I have more than 3 Years of experience in recruiting', 'shaareef IT-1.docx_$_'),
(15, 'Neha', 'Daripkar', 'nehaaraut15@lalpathlabs.com', 'Female', 'India (à¤­à¤¾à¤°à¤¤)', '7506836183', '7506836183', 'Thane', 'Thane', 'Thane', 'maharashtra', '400605', 'Oriental Vashi', '2022-10-27 00:57:36', 'Non - Technical', '7 Because as HR I shall assess the candidate basis to his behavioral aspects primarily and less on his technical aspects. Ultimate decision can be taken by the respective stakeholder.', 'I have done campus recruitments , JOB fairs, talent acquisition from naukri, linkedin & referrals', 'I have smart expertise of convincing candidates to join ones company and good in  negotiations skills, I shall motivate the team members and shall gel with the team in no time which will further help team members work effectively\r\n\r\n', 'Neha Raut Daripkar Resume.pdf_$_'),
