(19, 'Gulista', 'Shaikh', 'gulistashaikh65@gmail.com', 'Female', 'India (à¤­à¤¾à¤°à¤¤)', '09137313749', '09137313749', 'ROOM NO 53, OLD SLAUGHTER HOUSE, COMPOUND,NEAR CHAWL NO 2, BANDRA WEST, COMPOUND,NEAR CHAWL NO 2', 'COMPOUND,NEAR CHAWL NO 2, Health care clinic.', 'Mumbai', 'Maharashtra', '400050', 'Rizvi college ', '2022-11-02 01:05:31', 'Non - Technical', 'I would rate 10/10..\r\n\r\nReason: my experience is similar. I\'m a quick learner.', 'I don\'t have experience in college fest hirings so far. but will surely like to learn and explore.', 'My experience is similar to what you looking for. I guess I would be the best fit for this role.', 'GULISTA SHAIKH CV_$_'),
