(22, 'PRATIMA', 'PAWAR', 'pratimapawar16@gmail.com', 'Female', 'India (', '9664763099', '9664763099', 'Kanjurmarg ', 'Ankur', 'Mumbai', 'Maharashtra ', '400042', 'RA PODAR ', '2023-01-06 01:56:37', 'Non - Technical', 'Have proven experience in HR domain frm last 9 years handling entire employee life cycle and experienced in team handling, grievance handling, benefits administration, stakeholder management and so on', 'BALMOHAN VIDYAMANDIR \r\nMEED\r\nWOLTERS KLUWER \r\nHDB', 'Have proven experience in HR domain frm last 9 years handling entire employee life cycle and experienced in team handling, grievance handling, benefits administration, stakeholder management and so on', 'Pratima Pawar 2023.docx_$_');
